var $autoConcepts = ['information', 'computer', 'computer system', 'network', 'machine', 'message', 'software', 'network software', 'personal area network', 'local area network', 'metropolitan area network', 'wide area network', 'open network', 'Internet', 'open system', 'transmission control protocol/internet protocol protocol suite', 'ethernet network', 'star network', 'access point', 'bus network', 'short bus', 'carrier sense', 'multiple access with collision detection', 'central access point', 'hidden terminal problem', 'collision avoidance', 'busy channel', 'silent channel', 'wifi network', 'traditional telephone', 'router', 'forwarding table', 'gateway', 'server', 'client/server model', 'print server', 'magnetic disk', 'mass storage', 'file server', 'peer-to-peer model', 'instant messaging', 'central server', 'DAR-pa', 'internet service provider', 'tier-1 internet service provider', 'tier-2 internet service provider', 'access internet service provider', 'intranet', 'internet access', 'end system', 'hot spot', 'end user', 'internet protocol', 'internet protocol address', 'bit pattern', 'mnemonic domain name', 'domain name', 'mnemonic address', 'name server', 'domain name system', 'registered domain', 'network protocol', 'file transfer protocol', 'secure shell', 'browser', 'hypertext transfer protocol', 'email message', 'simple mail transfer protocol', 'mail server', 'server process', 'remote mail server', 'remote server', 'network security', 'post office protocol version 3', 'internet mail access protocol', 'local machine', 'voice over internet protocol', 'internet infrastructure', 'transmission control protocol/internet protocol network', 'transmission control protocol/internet protocol system', '4G', 'phone network', 'phone technology', '1G', 'text messaging', '3G', 'internet protocol network', 'content delivery network', 'hypertext document', 'uniform resource locator', 'home page', 'hypertext markup language', 'hypertext markup language source document', 'extensible markup language', 'hypertext transfer protocol server', 'extensible markup language standard', 'search engine', 'client-side activity', 'server-side activity', 'server side', 'client side', 'internet software', 'application layer', 'transport layer', 'network layer', 'link layer', 'port number', 'transmission control protocol', 'user datagram protocol', 'internet protocol network layer', 'hop count', 'malicious software', 'trojan horse', 'denial of service', 'denial of service attack', 'service attack', 'proxy server', 'auditing software', 'antivirus software', 'public-key', 'public-key encryption', 'public-key encryption system', 'private-key', 'digital signature', 'electronic communication', 'electronic communication privacy act'].map(x => x.toUpperCase());

var $sentList = [{'sent_id': 1, 'text': 'The need to share information and resources among different computers has led to linked computer systems, called networks, in which computers are connected so that data can be transferred from machine to machine.', 'type': 'normal sentence'}, {'sent_id': 2, 'text': 'In these networks, computer users can exchange messages and share resources-such as printing capabilities, software packages, and data storage facilities-that are scattered throughout the system.', 'type': 'normal sentence'}, {'sent_id': 3, 'text': 'The underlying software required to support such applications has grown from simple utility packages into an expanding system of network software that provides a sophisticated network-wide infrastructure.', 'type': 'normal sentence'}, {'sent_id': 4, 'text': 'In a sense, network software is evolving into a network-wide operating system.', 'type': 'normal sentence'}, {'sent_id': 5, 'text': 'In this chapter we will explore this expanding field of computer science.', 'type': 'normal sentence'}, {'sent_id': 6, 'text': '4.1 Network Fundamentals', 'type': 'section title'}, {'sent_id': 7, 'text': 'We begin our study of networks by introducing a variety of basic networking concepts.', 'type': 'normal sentence'}, {'sent_id': 8, 'text': 'Network Classifications', 'type': 'subsection title'}, {'sent_id': 9, 'text': 'A computer network is often classified as being either a personal area network (PAN), a local area network (LAN), a metropolitan area network (MAN), or a wide area network (WAN).', 'type': 'normal sentence'}, {'sent_id': 10, 'text': 'A personal area network is normally used for shortrange communications-typically less than a few meters-such as between a wireless headset and a smartphone or between a wireless mouse and its PC.', 'type': 'normal sentence'}, {'sent_id': 11, 'text': 'In contrast, a local area network normally consists of a collection of computers in a single building or building complex.', 'type': 'normal sentence'}, {'sent_id': 12, 'text': 'For example, the computers on a university campus or those in a manufacturing plant might be connected by a local area network.', 'type': 'normal sentence'}, {'sent_id': 13, 'text': 'A metropolitan area network is a network of intermediate size, such as one spanning a local community.', 'type': 'normal sentence'}, {'sent_id': 14, 'text': 'Finally, a wide area network links machines over a greater distance-perhaps in neighboring cities or on opposite sides of the world.', 'type': 'normal sentence'}, {'sent_id': 15, 'text': "Another means of classifying networks is based on whether the network's internal operation is based on designs that are in the public domain or on innovations owned and controlled by a particular entity such as an individual or a corporation.", 'type': 'normal sentence'}, {'sent_id': 16, 'text': 'A network of the former type is called an open network; a network of the latter type is called a closed, or sometimes a proprietary, network.', 'type': 'normal sentence'}, {'sent_id': 17, 'text': 'Open network designs are freely circulated and often grow in popularity to the point that they ultimately prevail over proprietary approaches whose applications are restricted by license fees and contract conditions.', 'type': 'normal sentence'}, {'sent_id': 18, 'text': 'The Internet (a popular worldwide network of networks that we will study in this chapter) is an open system.', 'type': 'normal sentence'}, {'sent_id': 19, 'text': 'In particular, communication throughout the Internet is governed by an open collection of standards known as the transmission control protocol/internet protocol protocol suite, which is the subject of Section 4.4.', 'type': 'normal sentence'}, {'sent_id': 20, 'text': 'Anyone is free to use these standards without paying fees or signing license agreements.', 'type': 'normal sentence'}, {'sent_id': 21, 'text': 'In contrast, a company such as Novell Inc. might develop proprietary systems for which it chooses to maintain ownership rights, allowing the company to draw income from selling or leasing these products.', 'type': 'normal sentence'}, {'sent_id': 22, 'text': 'Still another way of classifying networks is based on the topology of the network, which refers to the pattern in which the machines are connected.', 'type': 'normal sentence'}, {'sent_id': 23, 'text': 'Two of the more popular topologies are the bus, in which the machines are all connected to a common communication line called a bus (Figure 4.1a), and the star, in which one machine serves as a central focal point to which all the others are connected (Figure 4.1b).', 'type': 'normal sentence'}, {'sent_id': 24, 'text': 'The bus topology was popularized in the 1990s when it was implemented under a set of standards known as Ethernet, and ethernet networks remain one of the most popular networking systems in use today.', 'type': 'normal sentence'}, {'sent_id': 25, 'text': 'The star topology has roots as far back as the 1970s.', 'type': 'normal sentence'}, {'sent_id': 26, 'text': 'It evolved from the paradigm of a large central computer serving many users.', 'type': 'normal sentence'}, {'sent_id': 27, 'text': 'As the simple terminals employed by these users grew into small computers themselves, a star network emerged.', 'type': 'normal sentence'}, {'sent_id': 28, 'text': 'Today, the star configuration is popular in wireless networks where communication is conducted by means of radio broadcast and the central machine, called the access point (AP), serves as a focal point around which all communication is coordinated.', 'type': 'normal sentence'}, {'sent_id': 29, 'text': 'The difference between a bus network and a star network is not always obvious by the physical arrangement of equipment.', 'type': 'normal sentence'}, {'sent_id': 30, 'text': 'The distinction is whether the machines in the network envision themselves as communicating directly with each other over a common bus or indirectly through an intermediary central machine.', 'type': 'normal sentence'}, {'sent_id': 31, 'text': 'For instance, a bus network might not appear as a long bus from which computers are connected over short links as depicted in Figure 4.1.', 'type': 'normal sentence'}, {'sent_id': 32, 'text': 'Instead, it may have a very short bus with long links to the individual machines, meaning that the network would look more like a star.', 'type': 'normal sentence'}, {'sent_id': 33, 'text': 'Indeed, sometimes a bus network is created by running links from each computer to a central location where they are connected to a device called a hub.', 'type': 'normal sentence'}, {'sent_id': 34, 'text': 'This hub is little more than a very short bus.', 'type': 'normal sentence'}, {'sent_id': 35, 'text': 'All it does is relay any signal it receives (with perhaps some amplification) back out to all the machines connected to it.', 'type': 'normal sentence'}, {'sent_id': 36, 'text': 'The result is a network that looks like a star network although it operates like a bus network.', 'type': 'normal sentence'}, {'sent_id': 37, 'text': 'Protocols For a network to function reliably, it is important to establish rules by which activities are conducted.', 'type': 'normal sentence'}, {'sent_id': 38, 'text': 'Such rules are called protocols.', 'type': 'normal sentence'}, {'sent_id': 39, 'text': 'By developing and adopting protocol standards, vendors are able to build products for network applications that are compatible with products from other vendors.', 'type': 'normal sentence'}, {'sent_id': 40, 'text': 'Thus, the development of protocol standards is an indispensable process in the development of networking technologies.', 'type': 'normal sentence'}, {'sent_id': 41, 'text': 'As an introduction to the protocol concept, let us consider the problem of coordinating the transmission of messages among computers in a network.', 'type': 'normal sentence'}, {'sent_id': 42, 'text': 'Without rules governing this communication, all the computers might insist on transmitting messages at the same time or fail to assist other machines when that assistance is required.', 'type': 'normal sentence'}, {'sent_id': 43, 'text': 'In a bus network based on the Ethernet standards, the right to transmit messages is controlled by the protocol known as carrier sense, multiple access with collision detection (CSMA/CD).', 'type': 'normal sentence'}, {'sent_id': 44, 'text': 'This protocol dictates that each message be broadcast to all the machines on the bus (Figure 4.2).', 'type': 'normal sentence'}, {'sent_id': 45, 'text': 'Each machine monitors all the messages but keeps only those addressed to itself.', 'type': 'normal sentence'}, {'sent_id': 46, 'text': 'To transmit a message, a machine waits until the bus is silent, and at this time it begins transmitting while continuing to monitor the bus.', 'type': 'normal sentence'}, {'sent_id': 47, 'text': 'If another machine also begins transmitting, both machines detect the clash and pause for a brief, independently random period of time before trying to transmit again.', 'type': 'normal sentence'}, {'sent_id': 48, 'text': 'The result is a system similar to that used by a small group of people in a conversation.', 'type': 'normal sentence'}, {'sent_id': 49, 'text': 'If two people start to talk at once, they both stop.', 'type': 'normal sentence'}, {'sent_id': 50, 'text': 'The difference is that people might go through a series such as, " I \'m sorry, what were you going to say? ", " No, no.', 'type': 'normal sentence'}, {'sent_id': 51, 'text': 'You go first ", whereas under the carrier sense, multiple access with collision detection protocol each machine merely tries again later.', 'type': 'normal sentence'}, {'sent_id': 52, 'text': 'Note that carrier sense, multiple access with collision detection is not compatible with wireless star networks in which all machines communicate through a central access point.', 'type': 'normal sentence'}, {'sent_id': 53, 'text': 'This is because a machine may be unable to detect that its transmissions are colliding with those of another.', 'type': 'normal sentence'}, {'sent_id': 54, 'text': 'For example, the machine may not hear the other because its own signal drowns out that of the other machine.', 'type': 'normal sentence'}, {'sent_id': 55, 'text': 'Another cause might be that the signals from the different machines are blocked from each other by objects or distance even though they can all communicate with the central access point (a condition known as the hidden terminal problem, Figure 4.3).', 'type': 'normal sentence'}, {'sent_id': 56, 'text': 'The result is that wireless networks adopt the policy of trying to avoid collisions rather than trying to detect them.', 'type': 'normal sentence'}, {'sent_id': 57, 'text': 'Such policies are classified as carrier sense, multiple access with collision avoidance (CSMA/CA), many of which are standardized by IEEE (see the sidebar " Institute of Electrical and Electronics Engineers " in Chapter 7) within the protocols defined in IEEE 802.11 and commonly referred to as wifi.', 'type': 'normal sentence'}, {'sent_id': 58, 'text': 'We emphasize that collision avoidance protocols are designed to avoid collisions and may not eliminate them completely.', 'type': 'normal sentence'}, {'sent_id': 59, 'text': 'When collisions do occur, messages must be retransmitted.', 'type': 'normal sentence'}, {'sent_id': 60, 'text': 'The most common approach to collision avoidance is based on giving advantage to machines that have already been waiting for an opportunity to transmit.', 'type': 'normal sentence'}, {'sent_id': 61, 'text': "The protocol used is similar to Ethernet's carrier sense, multiple access with collision detection.", 'type': 'normal sentence'}, {'sent_id': 62, 'text': 'The basic difference is that when a machine first needs to transmit a message and finds the communication channel silent, it does not start transmitting immediately.', 'type': 'normal sentence'}, {'sent_id': 63, 'text': 'Instead, it waits for a short period of time and then starts transmitting only if the channel has remained silent throughout that period.', 'type': 'normal sentence'}, {'sent_id': 64, 'text': 'If a busy channel is experienced during this process, the machine waits for a randomly determined period before trying again.', 'type': 'normal sentence'}, {'sent_id': 65, 'text': 'Once this period is exhausted, the machine is allowed to claim a silent channel without hesitation.', 'type': 'normal sentence'}, {'sent_id': 66, 'text': 'This means that collisions between " newcomers " and those that have already been waiting are avoided because a " newcomer " is not allowed to claim a silent channel until any machine that has been waiting is given the opportunity to start.', 'type': 'normal sentence'}, {'sent_id': 67, 'text': 'This protocol, however, does not solve the hidden terminal problem.', 'type': 'normal sentence'}, {'sent_id': 68, 'text': 'After all, any protocol based on distinguishing between a silent or busy channel requires that each individual station be able to hear all the others.', 'type': 'normal sentence'}, {'sent_id': 69, 'text': 'To solve this problem, some wifi networks require that each machine send a short " request " message to the access point and wait until the access point acknowledges that request before transmitting an entire message.', 'type': 'normal sentence'}, {'sent_id': 70, 'text': 'If the access point is busy because it is dealing with a " hidden terminal ", it will ignore the request, and the requesting machine will know to wait.', 'type': 'normal sentence'}, {'sent_id': 71, 'text': 'Otherwise, the access point will acknowledge the request, and the machine will know that it is safe to transmit.', 'type': 'normal sentence'}, {'sent_id': 72, 'text': 'Note that all the machines in the network will hear all acknowledgments sent from the access point and thus have a good idea of whether the access point is busy at any given time, even though they may not be able to hear the transmissions taking place.', 'type': 'normal sentence'}, {'sent_id': 73, 'text': 'Combining Networks', 'type': 'subsection title'}, {'sent_id': 74, 'text': 'Sometimes it is necessary to connect existing networks to form an extended communication system.', 'type': 'normal sentence'}, {'sent_id': 75, 'text': 'This can be done by connecting the networks to form a larger version of the same " type " of network.', 'type': 'normal sentence'}, {'sent_id': 76, 'text': 'For example, in the case of bus networks based on the Ethernet protocols, it is often possible to connect the buses to form a single long bus.', 'type': 'normal sentence'}, {'sent_id': 77, 'text': 'This is done by means of different devices known as repeaters, bridges, and switches, the distinctions of which are subtle yet informative.', 'type': 'normal sentence'}, {'sent_id': 78, 'text': 'The simplest of these is the repeater, which is little more than a device that passes signals back and forth between the two original buses (usually with some form of amplification) without considering the meaning of the signals (Figure 4.4a).', 'type': 'normal sentence'}, {'sent_id': 79, 'text': 'A bridge is similar to, but more complex than, a repeater.', 'type': 'normal sentence'}, {'sent_id': 80, 'text': 'Like a repeater, it connects two buses, but it does not necessarily pass all messages across the connection.', 'type': 'normal sentence'}, {'sent_id': 81, 'text': 'Instead, it looks at the destination address that accompanies each message and forwards a message across the connection only when that message is destined for a computer on the other side.', 'type': 'normal sentence'}, {'sent_id': 82, 'text': 'Thus, two machines residing on the same side of a bridge can exchange messages without interfering with communication taking place on the other side.', 'type': 'normal sentence'}, {'sent_id': 83, 'text': 'A bridge produces a more efficient system than that produced by a repeater.', 'type': 'normal sentence'}, {'sent_id': 84, 'text': 'A switch is essentially a bridge with multiple connections, allowing it to connect several buses rather than just two.', 'type': 'normal sentence'}, {'sent_id': 85, 'text': 'Thus, a switch produces a network consisting of several buses extending from the switch as spokes on a wheel (Figure 4.4b).', 'type': 'normal sentence'}, {'sent_id': 86, 'text': 'As in the case of a bridge, a switch considers the destination addresses of all messages and forwards only those messages destined for other spokes.', 'type': 'normal sentence'}, {'sent_id': 87, 'text': 'Moreover, each message that is forwarded is relayed only into the appropriate spoke, thus minimizing the traffic in each spoke.', 'type': 'normal sentence'}, {'sent_id': 88, 'text': 'It is important to note that when networks are connected via repeaters, bridges, and switches, the result is a single large network.', 'type': 'normal sentence'}, {'sent_id': 89, 'text': 'The entire system operates in the same manner (using the same protocols) as each of the original smaller networks.', 'type': 'normal sentence'}, {'sent_id': 90, 'text': 'Sometimes, however, the networks to be connected have incompatible characteristics.', 'type': 'normal sentence'}, {'sent_id': 91, 'text': 'For instance, the characteristics of a wifi network are not readily compatible with an ethernet network.', 'type': 'normal sentence'}, {'sent_id': 92, 'text': 'In these cases the networks must be connected in a manner that builds a network of networks, known as an internet, in which the original networks maintain their individuality and continue to function as autonomous networks.', 'type': 'normal sentence'}, {'sent_id': 93, 'text': 'Note that the generic term internet is distinct from the Internet.', 'type': 'normal sentence'}, {'sent_id': 94, 'text': 'The Internet, written with an uppercase I, refers to a particular, worldwide internet that we will study in later sections of this chapter.', 'type': 'normal sentence'}, {'sent_id': 95, 'text': 'There are many other examples of internets.', 'type': 'normal sentence'}, {'sent_id': 96, 'text': 'Indeed, traditional telephone communication was handled by worldwide internet systems well before the Internet was popularized.', 'type': 'normal sentence'}, {'sent_id': 97, 'text': 'The connection between networks to form an internet is handled by devices known as routers, which are special purpose computers used for forwarding messages.', 'type': 'normal sentence'}, {'sent_id': 98, 'text': 'Note that the task of a router is different from that of repeaters, bridges, and switches in that routers provide links between networks while allowing each network to maintain its unique internal characteristics.', 'type': 'normal sentence'}, {'sent_id': 99, 'text': 'As an example, Figure 4.5 depicts two wifi star networks and an Ethernet bus network connected by routers.', 'type': 'normal sentence'}, {'sent_id': 100, 'text': 'When a machine in one of the wifi networks wants to send a message to a machine in the ethernet network, it first sends the message to the access point in its network.', 'type': 'normal sentence'}, {'sent_id': 101, 'text': 'From there, the access point sends the message to its associated router, and this router forwards the message to the router at the Ethernet.', 'type': 'normal sentence'}, {'sent_id': 102, 'text': 'There the message is given to a machine on the bus, and that machine then forwards the message to its final destination in the Ethernet.', 'type': 'normal sentence'}, {'sent_id': 103, 'text': 'The reason that routers are so named is that their purpose is to forward messages in their proper directions.', 'type': 'normal sentence'}, {'sent_id': 104, 'text': 'This forwarding process is based on an internetwide addressing system in which all the devices in an internet (including the machines in the original networks and the routers) are assigned unique addresses.', 'type': 'normal sentence'}, {'sent_id': 105, 'text': 'Thus, each machine in one of the original networks has two addresses: its original " local " address within its own network and its internet address.', 'type': 'normal sentence'}, {'sent_id': 106, 'text': 'A machine wanting to send a message to a machine in a distant network attaches the internet address of the destination to the message and directs the message to its local router.', 'type': 'normal sentence'}, {'sent_id': 107, 'text': 'From there it is forwarded in the proper direction.', 'type': 'normal sentence'}, {'sent_id': 108, 'text': "For this forwarding purpose, each router maintains a forwarding table that contains the router's knowledge about the direction in which messages should be sent depending on their destination addresses.", 'type': 'normal sentence'}, {'sent_id': 109, 'text': 'The " point " at which one network is linked to an internet is often called a gateway because it serves as a passageway between the network and the outside world.', 'type': 'normal sentence'}, {'sent_id': 110, 'text': 'Gateways can be found in a variety of forms, and thus the term is used rather loosely.', 'type': 'normal sentence'}, {'sent_id': 111, 'text': "In many cases a network's gateway is merely the router through which it communicates with the rest of the internet.", 'type': 'normal sentence'}, {'sent_id': 112, 'text': 'In other cases the term gateway may be used to refer to more than just a router.', 'type': 'normal sentence'}, {'sent_id': 113, 'text': "For example, in most residential wifi networks that are connected to the Internet, the term gateway refers collectively to both the network's access point and the router connected to the access point because these two devices are normally packaged in a single unit.", 'type': 'normal sentence'}, {'sent_id': 114, 'text': 'Methods of Process Communication', 'type': 'subsection title'}, {'sent_id': 115, 'text': 'The various activities (or processes) executing on the different computers within a network (or even executing on the same machine via time-sharing/multitasking) must often communicate with each other to coordinate their actions and to perform their designated tasks.', 'type': 'normal sentence'}, {'sent_id': 116, 'text': 'Such communication between processes is called interprocess communication.', 'type': 'normal sentence'}, {'sent_id': 117, 'text': 'A popular convention used for interprocess communication is the client / server model.', 'type': 'normal sentence'}, {'sent_id': 118, 'text': 'This model defines the basic roles played by the processes as either a client, which makes requests of other processes, or a server, which satisfies the requests made by clients.', 'type': 'normal sentence'}, {'sent_id': 119, 'text': 'An early application of the client/server model appeared in networks connecting all the computers in a cluster of offices.', 'type': 'normal sentence'}, {'sent_id': 120, 'text': 'In this situation, a single, highquality printer was attached to the network where it was available to all the machines in the network.', 'type': 'normal sentence'}, {'sent_id': 121, 'text': 'In this case the printer played the role of a server (often called a print server), and the other machines were programmed to play the role of clients that sent print requests to the print server.', 'type': 'normal sentence'}, {'sent_id': 122, 'text': 'Another early application of the client/server model was used to reduce the cost of magnetic disk storage while also removing the need for duplicate copies of records.', 'type': 'normal sentence'}, {'sent_id': 123, 'text': "Here one machine in a network was equipped with a high-capacity mass storage system (usually a magnetic disk) that contained all of an organization's records.", 'type': 'normal sentence'}, {'sent_id': 124, 'text': 'Other machines on the network then requested access to the records as they needed them.', 'type': 'normal sentence'}, {'sent_id': 125, 'text': 'Thus the machine that actually contained the records played the role of a server (called a file server), and the other machines played the role of clients that requested access to the files that were stored at the file server.', 'type': 'normal sentence'}, {'sent_id': 126, 'text': 'Today the client/server model is used extensively in network applications, as we will see later in this chapter.', 'type': 'normal sentence'}, {'sent_id': 127, 'text': 'However, the client/server model is not the only means of interprocess communication.', 'type': 'normal sentence'}, {'sent_id': 128, 'text': 'Another model is the peer-to-peer (often abbreviated P2P) model.', 'type': 'normal sentence'}, {'sent_id': 129, 'text': 'Whereas the client/server model involves one process (the server) providing a service to numerous others (clients), the peer-topeer model involves processes that provide service to and receive service from each other (Figure 4.6).', 'type': 'normal sentence'}, {'sent_id': 130, 'text': 'Moreover, whereas a server must execute continuously so that it is prepared to serve its clients at any time, the peer-to-peer model usually involves processes that execute on a temporary basis.', 'type': 'normal sentence'}, {'sent_id': 131, 'text': 'For example, applications of the peer-to-peer model include instant messaging in which people carry on a written conversation over the Internet as well as situations in which people play competitive interactive games.', 'type': 'normal sentence'}, {'sent_id': 132, 'text': 'The peer-to-peer model is also a popular means of distributing files such as music recordings and motion pictures via the Internet.', 'type': 'normal sentence'}, {'sent_id': 133, 'text': 'In this case, one peer may receive a file from another and then provide that file to other peers.', 'type': 'normal sentence'}, {'sent_id': 134, 'text': 'The collection of peers participating in such a distribution is sometimes called a swarm.', 'type': 'normal sentence'}, {'sent_id': 135, 'text': 'The swarm approach to file distribution is in contrast to earlier approaches that applied the client/server model by establishing a central distribution center (the server) from which clients downloaded files (or at least found sources for those files).', 'type': 'normal sentence'}, {'sent_id': 136, 'text': 'One reason that the peer-to-peer model is replacing the client/server model for file sharing is that it distributes the service task over many peers rather than concentrating it at one server.', 'type': 'normal sentence'}, {'sent_id': 137, 'text': 'This lack of a centralized base of operation leads to a more efficient system.', 'type': 'normal sentence'}, {'sent_id': 138, 'text': 'Unfortunately, another reason for the popularity of file distribution systems based on the peer-to-peer model is that, in cases of questionable legality, the lack of a central server makes legal efforts to enforce copyright laws more difficult.', 'type': 'normal sentence'}, {'sent_id': 139, 'text': 'There are numerous cases, however, in which individuals have discovered that " difficult " does not mean " impossible " and have found themselves faced with significant liabilities due to copyright infringement violations.', 'type': 'normal sentence'}, {'sent_id': 140, 'text': 'You might often read or hear the term peer-to-peer network, which is an example of how misuse of terminology can evolve when technical terms are adopted by the nontechnical community.', 'type': 'normal sentence'}, {'sent_id': 141, 'text': 'The term peer-to-peer refers to a system by which two processes communicate over a network (or internet).', 'type': 'normal sentence'}, {'sent_id': 142, 'text': 'It is not a property of the network (or internet).', 'type': 'normal sentence'}, {'sent_id': 143, 'text': 'A process might use the peer-to-peer model to communicate with another process and later use the client/server model to communicate with another process over the same network.', 'type': 'normal sentence'}, {'sent_id': 144, 'text': 'Thus, it would be more accurate to speak of communicating by means of the peer-to-peer model rather than communicating over a peer-to-peer network.', 'type': 'normal sentence'}, {'sent_id': 145, 'text': 'Distributed Systems', 'type': 'subsection title'}, {'sent_id': 146, 'text': 'With the success of networking technology, interaction between computers via networks has become common and multifaceted.', 'type': 'normal sentence'}, {'sent_id': 147, 'text': "Many modern software systems, such as global information retrieval systems, company-wide accounting and inventory systems, computer games, and even the software that controls a network's infrastructure itself are designed as distributed systems, meaning that they consist of software units that execute as processes on different computers.", 'type': 'normal sentence'}, {'sent_id': 148, 'text': 'Early distributed systems were developed independently from scratch.', 'type': 'normal sentence'}, {'sent_id': 149, 'text': 'But today, research is revealing a common infrastructure running throughout these systems, including such things as communication and security systems.', 'type': 'normal sentence'}, {'sent_id': 150, 'text': 'In turn, efforts have been made to produce prefabricated systems that provide this basic infrastructure and therefore allow distributed applications to be constructed by merely developing the part of the system that is unique to the application.', 'type': 'normal sentence'}, {'sent_id': 151, 'text': 'Several types of distributed computing systems are now common.', 'type': 'normal sentence'}, {'sent_id': 152, 'text': 'Cluster computing describes a distributed system in which many independent computers work closely together to provide computation or services comparable to a much larger machine.', 'type': 'normal sentence'}, {'sent_id': 153, 'text': 'The cost of these individual machines, plus the high-speed network to connect them, can be less than a higher-priced supercomputer, but with higher reliability and lower maintenance costs.', 'type': 'normal sentence'}, {'sent_id': 154, 'text': 'Such distributed systems are used to provide high-availability-because it is more likely that at least one member of the cluster will be able to answer a request, even if other cluster members break down or are unavailable-and load-balancing-because the workload can be shifted automatically from members of the cluster that have too much to do to those that may have too little.', 'type': 'normal sentence'}, {'sent_id': 155, 'text': 'Grid computing refers to distributed systems that are more loosely coupled than clusters but that still work together to accomplish large tasks.', 'type': 'normal sentence'}, {'sent_id': 156, 'text': 'Grid computing can involve specialized software to make it easier to distribute data and algorithms to the machines participating in a grid.', 'type': 'normal sentence'}, {'sent_id': 157, 'text': "Examples include University of Wisconsin's Condor system, or Berkeley's Open Infrastructure for Network Computing (BOINC).", 'type': 'normal sentence'}, {'sent_id': 158, 'text': 'Both of these systems are often installed on computers that are used for other purposes, such as PCs at work or at home, that can then volunteer computing power to the grid when the machine is not otherwise being used.', 'type': 'normal sentence'}, {'sent_id': 159, 'text': 'Enabled by the growing connectivity of the Internet, this type of voluntary, distributed grid computing has enabled millions of home PCs to work on enormously complex mathematical and scientific problems.', 'type': 'normal sentence'}, {'sent_id': 160, 'text': 'Cloud computing, whereby huge pools of shared computers on the network can be allocated for use by clients as needed, is the latest trend in distributed systems.', 'type': 'normal sentence'}, {'sent_id': 161, 'text': 'Much as the spread of metropolitan electrical grids in the early twentieth century eliminated the need for individual factories and businesses to maintain their own generators, the Internet is making it possible for entities to entrust their data and computations to " the Cloud ", which in this case refers to the enormous computing resources already available on the network.', 'type': 'normal sentence'}, {'sent_id': 162, 'text': "Services such as Amazon's Elastic Compute Cloud allow clients to rent virtual computers by the hour, without concern for where the computer hardware is actually located.", 'type': 'normal sentence'}, {'sent_id': 163, 'text': 'Google Drive and Google Apps allow users to collaborate on information or build Web services without needing to know how many computers are working on the problem or where the relevant data are stored.', 'type': 'normal sentence'}, {'sent_id': 164, 'text': 'Cloud computing services provide reasonable guarantees of reliability and scalability, but also raise concerns about privacy and security in a world where we may no longer know who owns and operates the computers that we use.', 'type': 'normal sentence'}, {'sent_id': 165, 'text': '4.2 The Internet', 'type': 'section title'}, {'sent_id': 166, 'text': 'The most notable example of an internet is the Internet (note the uppercase I), which originated from research projects going back to the early 1960s.', 'type': 'normal sentence'}, {'sent_id': 167, 'text': 'The goal was to develop the ability to link a variety of computer networks so that they could function as a connected system that would not be disrupted by local disasters.', 'type': 'normal sentence'}, {'sent_id': 168, 'text': 'Much of this work was sponsored by the U.S. government through the Defense Advanced Research Projects Agency (DARPA-pronounced " DAR-pa ").', 'type': 'normal sentence'}, {'sent_id': 169, 'text': 'Over the years, the development of the Internet shifted from a governmentsponsored project to an academic research project, and today it is largely a commercial undertaking that links a worldwide combination of personal area networks, local area networks, metropolitan area networks, and wide area networks involving millions of computers.', 'type': 'normal sentence'}, {'sent_id': 170, 'text': 'Internet Architecture', 'type': 'subsection title'}, {'sent_id': 171, 'text': 'As we have already mentioned, the Internet is a collection of connected networks.', 'type': 'normal sentence'}, {'sent_id': 172, 'text': 'In general, these networks are constructed and maintained by organizations called internet service providers (ISPs).', 'type': 'normal sentence'}, {'sent_id': 173, 'text': 'It is also customary to use the term internet service provider in reference to the networks themselves.', 'type': 'normal sentence'}, {'sent_id': 174, 'text': 'Thus, we will speak of connecting to an internet service provider, when what we really mean is connecting to the network provided by an internet service provider.', 'type': 'normal sentence'}, {'sent_id': 175, 'text': 'The system of networks operated by the internet service providers can be classified in a hierarchy according to the role they play in the overall Internet structure (Figure 4.7).', 'type': 'normal sentence'}, {'sent_id': 176, 'text': 'At the top of this hierarchy are relatively few tier-1 internet service providers that consist of very highspeed, high-capacity, international wide area networks.', 'type': 'normal sentence'}, {'sent_id': 177, 'text': 'These networks are thought of as the backbone of the Internet.', 'type': 'normal sentence'}, {'sent_id': 178, 'text': 'They are typically operated by large companies that are in the communications business.', 'type': 'normal sentence'}, {'sent_id': 179, 'text': 'An example would be a company that originated as a traditional telephone company and has expanded its scope into providing other communication services.', 'type': 'normal sentence'}, {'sent_id': 180, 'text': 'Connecting to the tier-1 internet service providers are the tier-2 internet service providers that tend to be more regional in scope and less potent in their capabilities.', 'type': 'normal sentence'}, {'sent_id': 181, 'text': 'The distinction between the tier-1 and tier-2 internet service providers is often a matter of opinion.', 'type': 'normal sentence'}, {'sent_id': 182, 'text': 'Again, these networks tend to be operated by companies in the communications business.', 'type': 'normal sentence'}, {'sent_id': 183, 'text': "Tier-1 and tier-2 internet service providers are essentially networks of routers that collectively provide the Internet's communication infrastructure.", 'type': 'normal sentence'}, {'sent_id': 184, 'text': 'As such, they can be thought of as the core of the Internet.', 'type': 'normal sentence'}, {'sent_id': 185, 'text': 'Access to this core is usually provided by an intermediary called an access or tier-3 internet service provider.', 'type': 'normal sentence'}, {'sent_id': 186, 'text': 'An access internet service provider is essentially an independent internet, sometimes called an intranet, operated by a single authority that is in the business of supplying internet access to individual homes and businesses.', 'type': 'normal sentence'}, {'sent_id': 187, 'text': 'Examples include cable and telephone companies that charge for their service as well as organizations such as universities or corporations that take it upon themselves to provide internet access to individuals within their organizations.', 'type': 'normal sentence'}, {'sent_id': 188, 'text': 'The devices that individual users connect to the access internet service providers are known as end systems or hosts.', 'type': 'normal sentence'}, {'sent_id': 189, 'text': 'These end systems may be laptops or PCs, but increasingly range over a multitude of other devices including telephones, video cameras, automobiles, and home appliances.', 'type': 'normal sentence'}, {'sent_id': 190, 'text': 'After all, the Internet is essentially a communications system, and thus any device that would benefit from communicating with other devices is a potential end system.', 'type': 'normal sentence'}, {'sent_id': 191, 'text': 'The technology by which end systems connect to larger networks is also varied.', 'type': 'normal sentence'}, {'sent_id': 192, 'text': 'Perhaps the fastest growing are wireless connections based on wifi technology.', 'type': 'normal sentence'}, {'sent_id': 193, 'text': "The strategy is to connect the access point to an access internet service provider and thus provide internet access through that internet service provider to end systems within the access point's broadcast range.", 'type': 'normal sentence'}, {'sent_id': 194, 'text': "The area within the access point or group of access points' range is often called a hot spot, particularly when the network access is publicly available or free.", 'type': 'normal sentence'}, {'sent_id': 195, 'text': 'Hot spots can be found in individual residences, hotel and office buildings, small businesses, parks, and in some cases span entire cities.', 'type': 'normal sentence'}, {'sent_id': 196, 'text': 'A similar technology is used by the cellular telephone industry where hot spots are known as cells and the " routers " generating the cells are coordinated to provide continuous service as an end system moves from one cell to another.', 'type': 'normal sentence'}, {'sent_id': 197, 'text': 'Internet2', 'type': 'normal sentence'}, {'sent_id': 198, 'text': 'Now that the Internet has shifted from a research project to a household commodity, the research community has moved on to a project called Internet2.', 'type': 'normal sentence'}, {'sent_id': 199, 'text': 'Internet2 is intended as an academic-only system and involves numerous universities working in partnership with industry and government.', 'type': 'normal sentence'}, {'sent_id': 200, 'text': 'The goal is to conduct research in internet applications requiring high bandwidth communication, such as remote access and control of costly state-of-the-art equipment such as telescopes and medical diagnostic devices.', 'type': 'normal sentence'}, {'sent_id': 201, 'text': 'An example of current research involves remote surgery performed by robot hands that mimic the hands of a distant surgeon who views the patient by video.', 'type': 'normal sentence'}, {'sent_id': 202, 'text': 'You can learn more about Internet2 at http://www.internet2.org.', 'type': 'normal sentence'}, {'sent_id': 203, 'text': "Other popular techniques for connecting to access internet service provider's use telephone lines or cable/satellite systems.", 'type': 'normal sentence'}, {'sent_id': 204, 'text': "These technologies may be used to provide direct connection to an end system or to a customer's router to which multiple end systems are connected.", 'type': 'normal sentence'}, {'sent_id': 205, 'text': 'This latter tactic is popular for individual residences where a local hot spot is created by a router / access point connected to an access internet service provider by means of existing cable or telephone lines.', 'type': 'normal sentence'}, {'sent_id': 206, 'text': 'Telephone, cable television, and satellite wide area networks of the twentieth century were designed to carry analog communications, such as the human voice or pre-digital television signals.', 'type': 'normal sentence'}, {'sent_id': 207, 'text': 'Modern networks can be designed to carry digital data directly between computers, but older, analog network infrastructure still comprises a significant portion of the Internet.', 'type': 'normal sentence'}, {'sent_id': 208, 'text': 'Issues arising from these legacy analog linkages are often referred to collectively as the last mile problem.', 'type': 'normal sentence'}, {'sent_id': 209, 'text': 'The main arteries of wide area networks, metropolitan area networks, and many local area networks are relatively easy to modernize with high-speed digital technology such as fiber optics, but it can be far costlier to replace the existing copper telephone lines and coaxial cables that connect these arteries to each individual home or office.', 'type': 'normal sentence'}, {'sent_id': 210, 'text': 'Thus, information that originated on the Internet continents away from an end system may spend almost its entire trip on high-speed digital connections, only to traverse the " last mile " to the end system over a slow, century-old analog phone line.', 'type': 'normal sentence'}, {'sent_id': 211, 'text': 'As alluded to in Chapter 2, several clever schemes have been developed to extend these legacy analog links to accommodate transmission of digital data.', 'type': 'normal sentence'}, {'sent_id': 212, 'text': 'DSL modems, cable modems, satellite uplinks, and even direct fiber-optic connections to the home are used to bring broadband internet access to end users.', 'type': 'normal sentence'}, {'sent_id': 213, 'text': 'Internet Addressing', 'type': 'subsection title'}, {'sent_id': 214, 'text': 'As we learned in Section 4.1, an internet needs an internet-wide addressing system that assigns a unique identifying address to each computer in the system.', 'type': 'normal sentence'}, {'sent_id': 215, 'text': 'In the Internet these addresses are known as internet protocol addresses.', 'type': 'normal sentence'}, {'sent_id': 216, 'text': 'The term internet protocol refers to " internet protocol ", which is a term we will learn more about in Section 4.4.', 'type': 'normal sentence'}, {'sent_id': 217, 'text': 'Originally, each internet protocol address was a pattern of 32 bits, but to provide a larger set of addresses, the process of converting to 128-bit addresses is currently underway (see the discussion of internet protocolv6 in Section 4.4).', 'type': 'normal sentence'}, {'sent_id': 218, 'text': "Blocks of consecutively numbered internet protocol addresses are awarded to internet service providers by the Internet Corporation for Assigned Names and Numbers (ICANN), which is a nonprofit corporation established to coordinate the Internet's operation.", 'type': 'normal sentence'}, {'sent_id': 219, 'text': 'The internet service providers are then allowed to allocate the addresses within their awarded blocks to machines within their region of authority.', 'type': 'normal sentence'}, {'sent_id': 220, 'text': 'Thus, machines throughout the Internet are assigned unique internet protocol addresses. internet protocol addresses are traditionally written in dotted decimal notation in which the bytes of the address are separated by periods and each byte is expressed as an integer represented in traditional base 10 notation.', 'type': 'normal sentence'}, {'sent_id': 221, 'text': 'For example, using dotted decimal notation, the pattern 5.2 would represent the two-byte bit pattern 0000010100000010, which consists of the byte 00000101 (represented by 5) followed by the byte 00000010 (represented by 2), and the pattern 17.12.25 would represent the three-byte bit pattern consisting of the byte 00010001 (which is 17 written in binary notation), followed by the byte 00001100 (12 written in binary), followed by the byte 00011001 (25 written in binary).', 'type': 'normal sentence'}, {'sent_id': 222, 'text': 'In summary, a 32-bit internet protocol address might appear as 192.207.177.133 when expressed in dotted decimal notation.', 'type': 'normal sentence'}, {'sent_id': 223, 'text': 'Addresses in bit-pattern form (even when compressed using dotted decimal notation) are rarely conducive to human consumption.', 'type': 'normal sentence'}, {'sent_id': 224, 'text': 'For this reason the Internet has an alternative addressing system in which machines are identified by mnemonic names.', 'type': 'normal sentence'}, {'sent_id': 225, 'text': 'This addressing system is based on the concept of a domain, which can be thought of as a " region " of the Internet operated by a single authority such as a university, club, company, or government agency.', 'type': 'normal sentence'}, {'sent_id': 226, 'text': 'The word region is in quotations here because, as we will soon see, such a region may not correspond to a physical area of the Internet.', 'type': 'normal sentence'}, {'sent_id': 227, 'text': 'Each domain must be registered with Internet Corporation for Assigned Names and Numbers-a process handled by companies, called registrars, that have been assigned this role by Internet Corporation for Assigned Names and Numbers.', 'type': 'normal sentence'}, {'sent_id': 228, 'text': 'As a part of this registration process, the domain is assigned a mnemonic domain name, which is unique among all the domain names throughout the Internet.', 'type': 'normal sentence'}, {'sent_id': 229, 'text': 'Domain names are often descriptive of the organization registering the domain, which enhances their utility for humans.', 'type': 'normal sentence'}, {'sent_id': 230, 'text': 'As an example, the domain name of Marquette University is mu.edu.', 'type': 'normal sentence'}, {'sent_id': 231, 'text': 'Note the suffix following the period.', 'type': 'normal sentence'}, {'sent_id': 232, 'text': 'It is used to reflect the domain\'s classification, which in this case is " educational " as indicated by the edu suffix.', 'type': 'normal sentence'}, {'sent_id': 233, 'text': 'These suffixes are called Top-Level Domains (TLDs).', 'type': 'normal sentence'}, {'sent_id': 234, 'text': 'Other Top-Level Domains include com for commercial institutions, gov for U.S. government institutions, org for nonprofit organizations, museum for museums, info for unrestricted use, and net, which was originally intended for internet service providers but is now used on a much broader scale.', 'type': 'normal sentence'}, {'sent_id': 235, 'text': 'In addition to these general Top-Level Domains, there are also two-letter Top-Level Domains for specific countries (called country-code Top-Level Domains) such as au for Australia and ca for Canada.', 'type': 'normal sentence'}, {'sent_id': 236, 'text': "Once a domain's mnemonic name is registered, the organization that registered the name is free to extend the name to obtain mnemonic identifiers for individual items within the domain.", 'type': 'normal sentence'}, {'sent_id': 237, 'text': 'For example, an individual host within Marquette University may be identified as eagle.mu.edu.', 'type': 'normal sentence'}, {'sent_id': 238, 'text': 'Note that domain names are extended to the left and separated by a period.', 'type': 'normal sentence'}, {'sent_id': 239, 'text': 'In some cases multiple extensions, called subdomains, are used as a means of organizing the names within a domain.', 'type': 'normal sentence'}, {'sent_id': 240, 'text': "These subdomains often represent different networks within the domain's jurisdiction.", 'type': 'normal sentence'}, {'sent_id': 241, 'text': 'For example, if Yoyodyne Corporation was assigned the domain name yoyodyne.com, then an individual computer at Yoyodyne might have a name such as overthruster.propulsion.yoyodyne.com, meaning that the computer overthruster is in the subdomain propulsion within the domain yoyodyne within the Top-Level Domain com.', 'type': 'normal sentence'}, {'sent_id': 242, 'text': 'We should emphasize that the dotted notation used in mnemonic addresses is not related to the dotted decimal notation used to represent addresses in bit pattern form.', 'type': 'normal sentence'}, {'sent_id': 243, 'text': 'Although mnemonic addresses are convenient for humans, messages are always transferred over the Internet by means of internet protocol addresses.', 'type': 'normal sentence'}, {'sent_id': 244, 'text': 'Thus, if a human wants to send a message to a distant machine and identifies the destination by means of a mnemonic address, the software being used must be able to convert that address into an internet protocol address before transmitting the message.', 'type': 'normal sentence'}, {'sent_id': 245, 'text': 'This conversion is performed with the aid of numerous servers, called name servers, that are essentially directories that provide address translation services to clients.', 'type': 'normal sentence'}, {'sent_id': 246, 'text': 'Collectively, these name servers are used as an Internet-wide directory system known as the domain name system (DNS).', 'type': 'normal sentence'}, {'sent_id': 247, 'text': 'The process of using domain name system to perform a translation is called a domain name system lookup.', 'type': 'normal sentence'}, {'sent_id': 248, 'text': 'Thus, for a machine to be accessible by means of a mnemonic domain name, that name must be represented in a name server within the domain name system.', 'type': 'normal sentence'}, {'sent_id': 249, 'text': 'In those cases in which the entity establishing the domain has the resources, it can establish and maintain its own name server containing all the names within that domain.', 'type': 'normal sentence'}, {'sent_id': 250, 'text': 'Indeed, this is the model on which the domain system was originally based.', 'type': 'normal sentence'}, {'sent_id': 251, 'text': 'Each registered domain represented a physical region of the Internet that was operated by a local authority such as a company, university, or government agency.', 'type': 'normal sentence'}, {'sent_id': 252, 'text': 'This authority was essentially an access internet service provider that provided internet access to its members by means of its own intranet that was linked to the Internet.', 'type': 'normal sentence'}, {'sent_id': 253, 'text': 'As part of this system, the organization maintained its own name server that provided translation services for all the names used within its domain.', 'type': 'normal sentence'}, {'sent_id': 254, 'text': 'This model is still common today.', 'type': 'normal sentence'}, {'sent_id': 255, 'text': 'However, many individuals or small organizations want to establish a domain presence on the Internet without committing the resources necessary to support it.', 'type': 'normal sentence'}, {'sent_id': 256, 'text': 'For example, it might be beneficial for a local chess club to have a presence on the Internet as KingsandQueens.org, but the club would likely not have the resources to establish its own network, maintain a link from this network to the Internet, and implement its own name server.', 'type': 'normal sentence'}, {'sent_id': 257, 'text': 'In this case, the club can contract with an access internet service provider to create the appearance of a registered domain using the resources already established by the internet service provider.', 'type': 'normal sentence'}, {'sent_id': 258, 'text': "Typically, the club, perhaps with the assistance of the internet service provider, registers the name chosen by the club and contracts with the internet service provider to have that name included in the internet service provider's name server.", 'type': 'normal sentence'}, {'sent_id': 259, 'text': "This means that all domain name system lookups regarding the new domain name will be directed to the internet service provider's name server, from which the proper translation will be obtained.", 'type': 'normal sentence'}, {'sent_id': 260, 'text': 'In this way, many registered domains can reside within a single internet service provider, each often occupying only a small portion of a single computer.', 'type': 'normal sentence'}, {'sent_id': 261, 'text': 'Internet Applications', 'type': 'subsection title'}, {'sent_id': 262, 'text': 'In the earlier days of the Internet, most applications were separate, simple programs that each followed a network protocol.', 'type': 'normal sentence'}, {'sent_id': 263, 'text': 'A newsreader application contacted servers using the Network News Transfer Protocol (NNTP), an application for listing and copying files across the network implemented the file transfer protocol (FTP), or an application for accessing another computer from a great distance used the Telnet protocol, or later the secure shell (SSH) protocol.', 'type': 'normal sentence'}, {'sent_id': 264, 'text': 'As webservers and browsers have become more sophisticated, more and more of these traditional network applications have come to be handled by webpages via the powerful hypertext transfer protocol (HTTP).', 'type': 'normal sentence'}, {'sent_id': 265, 'text': 'Nevertheless, when examining a network protocol for an Internet application for the first time, it behooves us to begin with a few simpler examples before moving on to hypertext transfer protocol in the next section.', 'type': 'normal sentence'}, {'sent_id': 266, 'text': 'Electronic Mail A wide variety of systems now exist for exchanging messages between end users over the network; instant messaging (IM), browser-based online chatting, Twitter-based " tweets ", and the Facebook " wall " are but a few.', 'type': 'normal sentence'}, {'sent_id': 267, 'text': 'One of the oldest and most enduring uses of the Internet is the electronic mail system, or email for short.', 'type': 'normal sentence'}, {'sent_id': 268, 'text': "While many users now rely on their browser or a sophisticated application like Microsoft's Outlook, Apple's Mail, or Mozilla's Thunderbird to read and compose their email, the actual transmission of email messages from one computer to another on the Internet remains the domain of basic network protocols like simple mail transfer protocol.", 'type': 'normal sentence'}, {'sent_id': 269, 'text': 'Simple mail transfer protocol (SMTP) defines a way that two computers on the network may interact when transmitting an email message from one host to the other.', 'type': 'normal sentence'}, {'sent_id': 270, 'text': 'Consider the example case of a mail server mail.skaro.gov sending an email from end user " dalek " to end user " doctor " in the domain tardis.edu.', 'type': 'normal sentence'}, {'sent_id': 271, 'text': 'First, a mail handling process on mail.skaro.gov contacts the mail server process on mail.tardis.edu.', 'type': 'normal sentence'}, {'sent_id': 272, 'text': 'To accomplish this, it uses domain name system, another network protocol, to map the human-readable destination domain name to the proper mail server name, and then to its internet protocol address.', 'type': 'normal sentence'}, {'sent_id': 273, 'text': 'This is not unlike looking up the phone number of an acquaintance before dialing.', 'type': 'normal sentence'}, {'sent_id': 274, 'text': 'Similarly, when the server process at the other end answers, the protocol states that it must identify itself to the caller.', 'type': 'normal sentence'}, {'sent_id': 275, 'text': 'The transcript of their simple mail transfer protocol exchange might look something like this: In line 1, the remote mail server process answers the caller by announcing its name, the protocol it speaks, and other optional information, such as the version of protocol, and the date and time.', 'type': 'normal sentence'}, {'sent_id': 276, 'text': 'In line 2, the sending mail server process introduces itself.', 'type': 'normal sentence'}, {'sent_id': 277, 'text': 'In line 3, the remote server acknowledges the name of the sending server.', 'type': 'normal sentence'}, {'sent_id': 278, 'text': 'Most internet protocols are not necessarily transmitted in ASCII characters so easily interpreted by a human.', 'type': 'normal sentence'}, {'sent_id': 279, 'text': 'To be sure, the quaint politeness of " pleased to meet you " in line 3 is neither appreciated by the software on either end of this connection, nor essential to simple mail transfer protocol\'s proper function.', 'type': 'normal sentence'}, {'sent_id': 280, 'text': 'However, this is actual behavior built into one popular simple mail transfer protocol mail server, held over from the early days of the Internet when human operators frequently needed to review simple mail transfer protocol transcripts to debug incompatibilities between mail servers.', 'type': 'normal sentence'}, {'sent_id': 281, 'text': 'Untold millions of these exchanges occur on the network each day, known only to the software agents that transport email across the Internet.', 'type': 'normal sentence'}, {'sent_id': 282, 'text': 'In the simplest case, the remote mail server will take mail.skaro.gov at its word in line 2, accepting that the sending server is the machine named mail from the domain skaro.gov. simple mail transfer protocol is an example of a protocol originally built on trust that has subsequently been abused by spammers and other Internet miscreants.', 'type': 'normal sentence'}, {'sent_id': 283, 'text': 'Modern mail servers must use extended versions of simple mail transfer protocol or their equivalent to help ensure that email is transmitted securely.', 'type': 'normal sentence'}, {'sent_id': 284, 'text': 'We discuss concerns about network security in greater detail in the final segment of this chapter.', 'type': 'normal sentence'}, {'sent_id': 285, 'text': 'Returning to the transcript, in line 4 the sending server announces that it has a mail message to deliver, and identifies the sending user.', 'type': 'normal sentence'}, {'sent_id': 286, 'text': 'In line 5, the remote server acknowledges that it will receive mail from this user at this domain.', 'type': 'normal sentence'}, {'sent_id': 287, 'text': 'In line 6, the sending server announces the recipient on the remote server.', 'type': 'normal sentence'}, {'sent_id': 288, 'text': 'In line 7, the remote server acknowledges that it will receive email destined for that user.', 'type': 'normal sentence'}, {'sent_id': 289, 'text': 'In line 8, the sending server dispenses with the introductions, and announces that it is ready to send the DATA, the actual body of the e-mail message.', 'type': 'normal sentence'}, {'sent_id': 290, 'text': 'In line 8, the remote server acknowledges (with code 354, in accordance with the simple mail transfer protocol protocol) that it is ready to receive the body of the message and includes a helpful human-readable instruction on how to conclude the message transfer.', 'type': 'normal sentence'}, {'sent_id': 291, 'text': 'In lines 10 through 14, the sending server conveys the text of the email message to be delivered.', 'type': 'normal sentence'}, {'sent_id': 292, 'text': "The remote server acknowledges acceptance in line 15, and in line 17 acknowledges the sending server's QUIT announcement from line 16.", 'type': 'normal sentence'}, {'sent_id': 293, 'text': 'The technical documents describing simple mail transfer protocol define each of the allowed steps in a conversation such as the transcript above.', 'type': 'normal sentence'}, {'sent_id': 294, 'text': 'The keywords HELO, MAIL, RCPT, DATA, and QUIT are each precisely defined in terms of how they will be sent, what options can accompany them, and how they should be interpreted.', 'type': 'normal sentence'}, {'sent_id': 295, 'text': "Similarly, the remote server's numeric response codes for acknowledgment are enumerated and defined.", 'type': 'normal sentence'}, {'sent_id': 296, 'text': 'Software designers use a protocol description to develop algorithms that will correctly implement sending and receiving email over the network.', 'type': 'normal sentence'}, {'sent_id': 297, 'text': 'Other protocols come into play for other aspects of transporting email.', 'type': 'normal sentence'}, {'sent_id': 298, 'text': 'Because simple mail transfer protocol was initially designed for transferring text messages encoded with ASCII, additional protocols such as multipurpose internet mail extension (MIME) have been developed to convert non-ASCII data to simple mail transfer protocol compatible form.', 'type': 'normal sentence'}, {'sent_id': 299, 'text': "There are two popular protocols that may be used for accessing email that has arrived and accumulated at a user's mail server.", 'type': 'normal sentence'}, {'sent_id': 300, 'text': 'These are POP3 (post office protocol version 3) and internet mail access protocol (IMAP). post office protocol version 3 (pronounced " pop-THREE ") is the simpler of the two.', 'type': 'normal sentence'}, {'sent_id': 301, 'text': 'Using post office protocol version 3, a user transfers (downloads) messages to his or her local computer where they can be read, stored in various folders, edited, and otherwise manipulated as the user desires.', 'type': 'normal sentence'}, {'sent_id': 302, 'text': "This is done on the user's local machine using the local machine's mass storage.", 'type': 'normal sentence'}, {'sent_id': 303, 'text': 'internet mail access protocol (pronounced " EYE-map ") allows a user to store and manipulate messages and related materials on the same machine as the mail server.', 'type': 'normal sentence'}, {'sent_id': 304, 'text': 'In this manner, a user who must access his or her email from different computers can maintain records at the mail server that are then accessible from any remote computer to which the user may have access.', 'type': 'normal sentence'}, {'sent_id': 305, 'text': 'VoIP', 'type': 'normal sentence'}, {'sent_id': 306, 'text': 'As an example of a more recent Internet application, consider voice over internet protocol (VoIP) in which the internet infrastructure is used to provide voice communication similar to that of traditional telephone systems.', 'type': 'normal sentence'}, {'sent_id': 307, 'text': 'In its simplest form, voice over internet protocol consists of two processes on different machines transferring audio data via the peer-to-peer model-a process that in itself presents no significant problems.', 'type': 'normal sentence'}, {'sent_id': 308, 'text': 'However, tasks such as initiating and receiving calls, linking voice over internet protocol with traditional telephone systems, and providing services such as emergency 911 communication are issues that extend beyond traditional Internet applications.', 'type': 'normal sentence'}, {'sent_id': 309, 'text': "Moreover, governments that own their country's traditional telephone companies view voice over internet protocol as a threat and have either taxed it heavily or outlawed it completely.", 'type': 'normal sentence'}, {'sent_id': 310, 'text': 'Existing voice over internet protocol systems come in four different forms that are competing for popularity.', 'type': 'normal sentence'}, {'sent_id': 311, 'text': 'Voice over internet protocol soft phones consist of peer-to-peer software that allows two or more PCs to share a call with no more special hardware than a speaker and a microphone.', 'type': 'normal sentence'}, {'sent_id': 312, 'text': 'An example of a voice over internet protocol soft phone system is Skype, which also provides its clients with links to the traditional telephone communication system.', 'type': 'normal sentence'}, {'sent_id': 313, 'text': 'One drawback to Skype is that it is a proprietary system, and thus much of its operational structure is not publicly known.', 'type': 'normal sentence'}, {'sent_id': 314, 'text': 'This means that Skype users must trust the integrity of the Skype software without third-party verification.', 'type': 'normal sentence'}, {'sent_id': 315, 'text': "For instance, to receive calls, a Skype user must leave his or her PC connected to the Internet and available to the Skype system, which means that some of the PC's resources may be used to support other Skype communications without the PC owner's awareness-a feature that has generated some resistance.", 'type': 'normal sentence'}, {'sent_id': 316, 'text': 'A second form of voice over internet protocol consists of analog telephone adapters, which are devices that allow a user to connect his or her traditional telephone to phone service provided by an access internet service provider.', 'type': 'normal sentence'}, {'sent_id': 317, 'text': 'This choice is frequently bundled with traditional Internet service and/or digital television service.', 'type': 'normal sentence'}, {'sent_id': 318, 'text': 'The third type of voice over internet protocol comes in the form of embedded voice over internet protocol phones, which are devices that replace a traditional telephone with an equivalent handset connected directly to a transmission control protocol/internet protocol network.', 'type': 'normal sentence'}, {'sent_id': 319, 'text': 'Embedded voice over internet protocol phones are becoming increasingly common for large organizations, many of whom are replacing their traditional internal copper wire telephone systems with voice over internet protocol over Ethernet to reduce costs and enhance features.', 'type': 'normal sentence'}, {'sent_id': 320, 'text': 'Finally, the current generation of smartphones use wireless voice over internet protocol technology.', 'type': 'normal sentence'}, {'sent_id': 321, 'text': "That is, earlier generations of wireless phones only communicated with the telephone company's network using that company's protocols.", 'type': 'normal sentence'}, {'sent_id': 322, 'text': "Access to the Internet was obtained by gateways between the company's network and the Internet, at which point signals were converted to the transmission control protocol/internet protocol system.", 'type': 'normal sentence'}, {'sent_id': 323, 'text': 'However, the 4G phone network is an internet protocol-based network throughout, which means a 4G telephone is essentially just another broadband-connected host computer on the global Internet.', 'type': 'normal sentence'}, {'sent_id': 324, 'text': 'Internet Multimedia Streaming', 'type': 'normal sentence'}, {'sent_id': 325, 'text': 'An enormous portion of current Internet traffic is used for transporting audio and video across the Internet in real-time, known as streaming.', 'type': 'normal sentence'}, {'sent_id': 326, 'text': 'Netflix streamed more than 4 billion hours of programming to end users in the first three months of 2013 alone.', 'type': 'normal sentence'}, {'sent_id': 327, 'text': 'Combined with YouTube, these two services will consume more than half of the bandwidth of the Internet in 2014.', 'type': 'normal sentence'}, {'sent_id': 328, 'text': 'The Generations of wireless telephones', 'type': 'normal sentence'}, {'sent_id': 329, 'text': 'Mobile phone technology has evolved rapidly since the first simple, handheld electronic units were introduced in the 1980s.', 'type': 'normal sentence'}, {'sent_id': 330, 'text': 'An entirely new wave of phone technology has emerged roughly every 10 years since that time, leading up to our current complex, multifunction smartphones.', 'type': 'normal sentence'}, {'sent_id': 331, 'text': 'The first generation wireless telephone network transmitted analog voice signals through the air, much like traditional telephones but without the copper wire running into the wall.', 'type': 'normal sentence'}, {'sent_id': 332, 'text': 'In retrospect, we call these early phones " 1G ", or first generation.', 'type': 'normal sentence'}, {'sent_id': 333, 'text': 'The second generation used digital signals to encode voice, providing more effective use of the airwaves, and the transmission of other kinds of digital data, like text messaging.', 'type': 'normal sentence'}, {'sent_id': 334, 'text': 'The Third Generation (" 3G ") phone network provided higher data rates, allowing for mobile video calls and other bandwidth-intensive activities.', 'type': 'normal sentence'}, {'sent_id': 335, 'text': 'The 4G network provides even higher data rates and a fully packet-switched internet protocol network, which has allowed smartphones to enjoy the connectivity and flexibility previously available only to broadband-enabled PCs.', 'type': 'normal sentence'}, {'sent_id': 336, 'text': 'The Generations of wireless telephones Mobile phone technology has evolved rapidly since the first simple, handheld electronic units were introduced in the 1980s.', 'type': 'normal sentence'}, {'sent_id': 337, 'text': 'An entirely new wave of phone technology has emerged roughly every 10 years since that time, leading up to our current complex, multifunction smartphones.', 'type': 'normal sentence'}, {'sent_id': 338, 'text': 'The first generation wireless telephone network transmitted analog voice signals through the air, much like traditional telephones but without the copper wire running into the wall.', 'type': 'normal sentence'}, {'sent_id': 339, 'text': 'In retrospect, we call these early phones " 1G ", or first generation.', 'type': 'normal sentence'}, {'sent_id': 340, 'text': 'The second generation used digital signals to encode voice, providing more effective use of the airwaves, and the transmission of other kinds of digital data, like text messaging.', 'type': 'normal sentence'}, {'sent_id': 341, 'text': 'The Third Generation (" 3G ") phone network provided higher data rates, allowing for mobile video calls and other bandwidth-intensive activities.', 'type': 'normal sentence'}, {'sent_id': 342, 'text': 'The 4G network provides even higher data rates and a fully packet-switched internet protocol network, which has allowed smartphones to enjoy the connectivity and flexibility previously available only to broadband-enabled PCs.', 'type': 'normal sentence'}, {'sent_id': 343, 'text': 'In order for this type of streaming to scale to thousands or even millions of simultaneous users, each with his or her own personal stream, replication of the content to many distinct servers is essential.', 'type': 'normal sentence'}, {'sent_id': 344, 'text': 'Large-scale streaming services make use of content delivery networks (CDNs), groups of servers distributed strategically around the Internet that specialize in streaming copies of content to nearby end users in their network " neighborhood ".', 'type': 'normal sentence'}, {'sent_id': 345, 'text': "In many cases, content delivery networks machines may reside in an access internet service provider network, allowing customers of that access internet service provider to stream copies of multimedia content at high speed from a nearby server that is much closer in the network than the streaming service's central server machines.", 'type': 'normal sentence'}, {'sent_id': 346, 'text': 'A networking technology called anycast, which enables an end user to automatically connect to the closest server out of a defined group of servers, helps to make content delivery networks practical.', 'type': 'normal sentence'}, {'sent_id': 347, 'text': 'Internet streaming of high-definition, on-demand video has permeated far more than traditional PCs.', 'type': 'normal sentence'}, {'sent_id': 348, 'text': 'A broad class of embedded devices such as televisions, DVD/Blu-ray players, smartphones, and game consoles connect directly to the transmission control protocol/internet protocol network to select viewable content from a multitude of both free and subscription servers.', 'type': 'normal sentence'}, {'sent_id': 349, 'text': '4.3 The world wide web', 'type': 'normal sentence'}, {'sent_id': 350, 'text': 'The world wide web had its origins in the work of Tim Berners-Lee who realized the potential of combining internet technology with the concept of linkeddocuments, called hypertext.', 'type': 'normal sentence'}, {'sent_id': 351, 'text': 'His first software for implementing the Web was released in December, 1990.', 'type': 'normal sentence'}, {'sent_id': 352, 'text': 'While this early prototype did not yet support multimedia data, it included the key components of what we now recognize as the world wide web: a hypertext document format for embedding hyperlinks to other documents; a protocol for transferring hypertext across the network, and a server process that supplied hypertext pages upon request.', 'type': 'normal sentence'}, {'sent_id': 353, 'text': 'From this humble beginning, the Web quickly grew to support images, audio and video, and by the mid-1990s had become the dominant application powering the growth of the Internet.', 'type': 'normal sentence'}, {'sent_id': 354, 'text': 'Web Implementation', 'type': 'subsection title'}, {'sent_id': 355, 'text': 'Software packages that allow users to access hypertext on the Internet fall into one of two categories: browsers and webservers.', 'type': 'normal sentence'}, {'sent_id': 356, 'text': "A browser resides on the user's computer and is charged with the tasks of obtaining materials requested by the user and presenting these materials to the user in an organized manner.", 'type': 'normal sentence'}, {'sent_id': 357, 'text': 'Common Internet browsers include Firefox, Safari, and Internet Explorer.', 'type': 'normal sentence'}, {'sent_id': 358, 'text': 'The webserver resides on a computer containing hypertext documents to be accessed.', 'type': 'normal sentence'}, {'sent_id': 359, 'text': 'Its task is to provide access to the documents under its control as requested by clients (browsers).', 'type': 'normal sentence'}, {'sent_id': 360, 'text': 'Hypertext documents are normally transferred between browsers and webservers using a protocol known as the hypertext transfer protocol (HTTP).', 'type': 'normal sentence'}, {'sent_id': 361, 'text': 'In order to locate and retrieve documents on the Web, each document is given a unique address called a uniform resource locator (URL).', 'type': 'normal sentence'}, {'sent_id': 362, 'text': 'Each uniform resource locator contains the information needed by a browser to contact the proper server and request the desired document.', 'type': 'normal sentence'}, {'sent_id': 363, 'text': 'Thus to view a webpage, a person first provides his or her browser with the uniform resource locator of the desired document and then instructs the browser to retrieve and display the document.', 'type': 'normal sentence'}, {'sent_id': 364, 'text': 'A typical uniform resource locator is presented in Figure 4.8.', 'type': 'normal sentence'}, {'sent_id': 365, 'text': 'It consists of four segments: the protocol to use to communicate with the server controlling access to the document, the mnemonic address of the machine containing the server, the directory path needed for the server to find the directory containing the document, and the name of the document itself.', 'type': 'normal sentence'}, {'sent_id': 366, 'text': 'In short, the uniform resource locator in Figure 4.8 tells a browser to contact the webserver on the computer known as eagle.mu.edu using the protocol hypertext transfer protocol and to retrieve the document named Julius_Caesar.html found within the subdirectory Shakespeare within the directory called authors.', 'type': 'normal sentence'}, {'sent_id': 367, 'text': 'Sometimes a uniform resource locator might not explicitly contain all the segments shown in Figure 4.8.', 'type': 'normal sentence'}, {'sent_id': 368, 'text': 'For example, if the server does not need to follow a directory path to reach the document, no directory path will appear in the uniform resource locator.', 'type': 'normal sentence'}, {'sent_id': 369, 'text': 'Moreover, sometimes a uniform resource locator will consist of only a protocol and the mnemonic address of a computer.', 'type': 'normal sentence'}, {'sent_id': 370, 'text': 'In these cases, the webserver at that computer will return a predetermined document, typically called a home page, that usually describes the information available at that website.', 'type': 'normal sentence'}, {'sent_id': 371, 'text': 'Such shortened uniform resource locators provide a simple means of contacting organizations.', 'type': 'normal sentence'}, {'sent_id': 372, 'text': 'For example, the uniform resource locator http://www.google.com will lead to the home page of Google, which contains hyperlinks to the services, products, and documents relating to the company.', 'type': 'normal sentence'}, {'sent_id': 373, 'text': 'To further simplify locating websites, many browsers assume that the hypertext transfer protocol protocol should be used if no protocol is identified.', 'type': 'normal sentence'}, {'sent_id': 374, 'text': 'These browsers correctly retrieve the Google home page when given the " uniform resource locator " consisting merely of www .google. com.', 'type': 'normal sentence'}, {'sent_id': 375, 'text': 'hypertext markup language', 'type': 'normal sentence'}, {'sent_id': 376, 'text': 'A traditional hypertext document is similar to a text file because its text is encoded character by character using a system such as ASCII or Unicode.', 'type': 'normal sentence'}, {'sent_id': 377, 'text': 'The distinction is that a hypertext document also contains special symbols, called tags, that describe how the document should appear on a display screen, what multimedia resources (such as images) should accompany the document, and which items within the document are linked to other documents.', 'type': 'normal sentence'}, {'sent_id': 378, 'text': 'This system of tags is known as hypertext markup language (HTML).', 'type': 'normal sentence'}, {'sent_id': 379, 'text': "Thus, it is in terms of hypertext markup language that an author of a webpage describes the information that a browser needs in order to present the page on the user's screen and to find any related documents referenced by the current page.", 'type': 'normal sentence'}, {'sent_id': 380, 'text': 'The process is analogous to adding typesetting directions to a plain typed text (perhaps using a red pen) so that a typesetter will know how the material should appear in its final form.', 'type': 'normal sentence'}, {'sent_id': 381, 'text': 'In the case of hypertext, the red markings are replaced by hypertext markup language tags, and a browser ultimately plays the role of the typesetter, reading the hypertext markup language tags to learn how the text is to be presented on the computer screen.', 'type': 'normal sentence'}, {'sent_id': 382, 'text': 'The hypertext markup language-encoded version (called the source version) of an extremely simple webpage is shown in Figure 4.9a.', 'type': 'normal sentence'}, {'sent_id': 383, 'text': 'Note that the tags are delineated by the symbols < and >.', 'type': 'normal sentence'}, {'sent_id': 384, 'text': 'The hypertext markup language source document consists of two sections-a head (surrounded by the < head > and < / head > tags) and a body (surrounded by the < body > and < / body > tags).', 'type': 'normal sentence'}, {'sent_id': 385, 'text': 'The distinction between the head and body of a webpage is similar to that of the head and body of an interoffice memo.', 'type': 'normal sentence'}, {'sent_id': 386, 'text': 'In both cases, the head contains preliminary information about the document (date, subject, etc. in the case of a memo).', 'type': 'normal sentence'}, {'sent_id': 387, 'text': 'The body contains the meat of the document, which in the case of a webpage is the material to be presented on the computer screen when the page is displayed.', 'type': 'normal sentence'}, {'sent_id': 388, 'text': 'The world wide web consortium The world wide web consortium (W3C) was formed in 1994 to promote the world wide web by developing protocol standards (known as world wide web consortium standards). world wide web consortium is headquartered at CERN, the high-energy particle physics laboratory in Geneva, Switzerland.', 'type': 'normal sentence'}, {'sent_id': 389, 'text': 'CERN is where the original hypertext markup language markup language was developed as well as the hypertext transfer protocol protocol for transferring hypertext markup language documents over the Internet.', 'type': 'normal sentence'}, {'sent_id': 390, 'text': 'Today world wide web consortium is the source of many standards (including standards for extensible markup language and numerous multimedia applications) that lead to compatibility over a wide range of Internet products.', 'type': 'normal sentence'}, {'sent_id': 391, 'text': 'You can learn more about world wide web consortium via its website at http://www.w3c.org.', 'type': 'normal sentence'}, {'sent_id': 392, 'text': 'The head of the webpage displayed in Figure 4.9a contains only the title of the document (surrounded by " title " tags).', 'type': 'normal sentence'}, {'sent_id': 393, 'text': 'This title is only for documentation purposes; it is not part of the page that is to be displayed on the computer screen.', 'type': 'normal sentence'}, {'sent_id': 394, 'text': 'The material that is displayed on the screen is contained in the body of the document.', 'type': 'normal sentence'}, {'sent_id': 395, 'text': 'The first entry in the body of the document in Figure 4.9a is a level-one heading (surrounded by the < h1 > and < / h1 > tags) containing the text " My Web Page ".', 'type': 'normal sentence'}, {'sent_id': 396, 'text': 'Being a level-one heading means that the browser should display this text prominently on the screen.', 'type': 'normal sentence'}, {'sent_id': 397, 'text': 'The next entry in the body is a paragraph of text (surrounded by the < p > and < / p > tags) containing the text " Click here for another page ".', 'type': 'normal sentence'}, {'sent_id': 398, 'text': 'Figure 4.9b shows the page as it would be presented on a computer screen by a browser.', 'type': 'normal sentence'}, {'sent_id': 399, 'text': 'In its present form, the page in Figure 4.9 is not fully functional in the sense that nothing will happen when the viewer clicks on the word here, even though the page implies that doing so will cause the browser to display another page.', 'type': 'normal sentence'}, {'sent_id': 400, 'text': 'To cause the appropriate action, we must link the word here to another document.', 'type': 'normal sentence'}, {'sent_id': 401, 'text': 'Let us suppose that, when the word here is clicked, we want the browser to retrieve and display the page at the uniform resource locator http://crafty.com/demo.html.', 'type': 'normal sentence'}, {'sent_id': 402, 'text': 'To do so, we must first surround the word here in the source version of the page with the tags < a > and < / a >, which are called anchor tags.', 'type': 'normal sentence'}, {'sent_id': 403, 'text': 'Inside the opening anchor tag we insert the parameter href = http://crafty.com/demo.html (as shown in Figure 4.10a) indicating that the hypertext reference (href) associated with the tag is the uniform resource locator following the equal sign (http://crafty.com/demo.html).', 'type': 'normal sentence'}, {'sent_id': 404, 'text': 'Having added the anchor tags, the webpage will now appear on a computer screen as shown in Figure 4.10b.', 'type': 'normal sentence'}, {'sent_id': 405, 'text': 'Note that this is identical to Figure 4.9b except that the word here is highlighted by color indicating that it is a link to another webpage.', 'type': 'normal sentence'}, {'sent_id': 406, 'text': 'Clicking on such highlighted terms will cause the browser to retrieve and display the associated webpage.', 'type': 'normal sentence'}, {'sent_id': 407, 'text': 'Thus, it is by means of anchor tags that webpages are linked to each other.', 'type': 'normal sentence'}, {'sent_id': 408, 'text': 'Finally, we should indicate how an image could be included in our simple webpage.', 'type': 'normal sentence'}, {'sent_id': 409, 'text': 'For this purpose, let us suppose that a JPEG encoding of the image we want to include is stored as the file named OurPic.jpg in the directory Images at Images.com and is available via the webserver at that location.', 'type': 'normal sentence'}, {'sent_id': 410, 'text': 'Under these conditions, we can tell a browser to display the image at the top of the webpage by inserting the image tag < img src = " http://Images.com/Images/OurPic.jpg " > immediately after the < body > tag in the hypertext markup language source document.', 'type': 'normal sentence'}, {'sent_id': 411, 'text': 'This tells the browser that the image named OurPic.jpg should be displayed at the beginning of the document.', 'type': 'normal sentence'}, {'sent_id': 412, 'text': 'The term src is short for " source ", meaning that the information following the equal sign indicates the source of the image to be displayed.', 'type': 'normal sentence'}, {'sent_id': 413, 'text': 'When the browser finds this tag, it will send a message to the hypertext transfer protocol server at Images. com requesting the image called OurPic.jpg and then display the image appropriately.', 'type': 'normal sentence'}, {'sent_id': 414, 'text': 'If we moved the image tag to the end of the document just before the < / body > tag, then the browser would display the image at the bottom of the webpage.', 'type': 'normal sentence'}, {'sent_id': 415, 'text': 'There are, of course, more sophisticated techniques for positioning an image on a webpage, but these need not concern us now.', 'type': 'normal sentence'}, {'sent_id': 416, 'text': 'extensible markup language', 'type': 'normal sentence'}, {'sent_id': 417, 'text': "hypertext markup language is essentially a notational system by which a text document along with the document's appearance can be encoded as a simple text file.", 'type': 'normal sentence'}, {'sent_id': 418, 'text': 'In a similar manner we can also encode nontextual material as text files-an example being sheet music.', 'type': 'normal sentence'}, {'sent_id': 419, 'text': 'At first glance the pattern of staffs, measure bars, and notes in which music is traditionally represented does not conform to the character-bycharacter format dictated by text files.', 'type': 'normal sentence'}, {'sent_id': 420, 'text': 'However, we can overcome this problem by developing an alternative notation system.', 'type': 'normal sentence'}, {'sent_id': 421, 'text': 'More precisely, we could agree to represent the start of a staff by < staff clef = " treble " >, the end of the staff by < / staff >, a time signature with the form < time > 2/4 < / time >, the beginning and ending of a measure by < measure > and < / measure >, respectively, a note such as an eighth note on C as < notes > egth C < / notes >, and so on.', 'type': 'normal sentence'}, {'sent_id': 422, 'text': 'Then the text could be used to encode the music shown in Figure 4.11.', 'type': 'normal sentence'}, {'sent_id': 423, 'text': 'Using such notation, sheet music could be encoded, modified, stored, and transferred over the Internet as text files.', 'type': 'normal sentence'}, {'sent_id': 424, 'text': 'Moreover, software could be written to present the contents of such files in the form of traditional sheet music or even to play the music on a synthesizer.', 'type': 'normal sentence'}, {'sent_id': 425, 'text': 'Note that our sheet music encoding system encompasses the same style used by hypertext markup language.', 'type': 'normal sentence'}, {'sent_id': 426, 'text': 'We chose to delineate the tags that identify components by the symbols < and >.', 'type': 'normal sentence'}, {'sent_id': 427, 'text': 'We chose to indicate the beginning and end of structures (such as a staff, string of notes, or measure) by tags of the same name-the ending tag being designated by a slash (a < measure > was terminated with the tag < / measure >).', 'type': 'normal sentence'}, {'sent_id': 428, 'text': 'And we chose to indicate special attributes within tags by expressions such as clef = " treble ".', 'type': 'normal sentence'}, {'sent_id': 429, 'text': 'This same style could also be used to develop systems for representing other formats such as mathematical expressions and graphics.', 'type': 'normal sentence'}, {'sent_id': 430, 'text': 'The extensible markup language (XML) is a standardized style (similar to that of our music example) for designing notational systems for representing data as text files.', 'type': 'normal sentence'}, {'sent_id': 431, 'text': 'Actually, extensible markup language is a simplified derivative of an older set of standards called the Standard Generalized Markup Language, better known as SGML.', 'type': 'normal sentence'}, {'sent_id': 432, 'text': 'Following the extensible markup language standard, notational systems called markup languages have been developed for representing mathematics, multimedia presentations, and music.', 'type': 'normal sentence'}, {'sent_id': 433, 'text': 'In fact, hypertext markup language is the markup language based on the extensible markup language standard that was developed for representing webpages.', 'type': 'normal sentence'}, {'sent_id': 434, 'text': 'Actually, the original version of hypertext markup language was developed before the extensible markup language standard was solidified, and therefore some features of hypertext markup language do not strictly conform to extensible markup language.', 'type': 'normal sentence'}, {'sent_id': 435, 'text': 'That is why you might see references to XHTML, which is the version of hypertext markup language that rigorously adheres to extensible markup language.', 'type': 'normal sentence'}, {'sent_id': 436, 'text': 'extensible markup language provides a good example of how standards are designed to have wideranging applications.', 'type': 'normal sentence'}, {'sent_id': 437, 'text': 'Rather than designing individual, unrelated markup languages for encoding various types of documents, the approach represented by extensible markup language is to develop a standard for markup languages in general.', 'type': 'normal sentence'}, {'sent_id': 438, 'text': 'With this standard, markup languages can be developed for various applications.', 'type': 'normal sentence'}, {'sent_id': 439, 'text': 'Markup languages developed in this manner possess a uniformity that allows them to be combined to obtain markup languages for complex applications such as text documents that contain segments of sheet music and mathematical expressions.', 'type': 'normal sentence'}, {'sent_id': 440, 'text': 'Finally, we should note that extensible markup language allows the development of new markup languages that differ from hypertext markup language in that they emphasize semantics rather than appearance.', 'type': 'normal sentence'}, {'sent_id': 441, 'text': 'For example, with hypertext markup language the ingredients in a recipe can be marked so that they appear as a list in which each ingredient is positioned on a separate line.', 'type': 'normal sentence'}, {'sent_id': 442, 'text': 'But if we used semantic-oriented tags, ingredients in a recipe could be marked as ingredients (perhaps using the tags < ingredient > and < / ingredient >) rather than merely items in a list.', 'type': 'normal sentence'}, {'sent_id': 443, 'text': 'The difference is subtle but important.', 'type': 'normal sentence'}, {'sent_id': 444, 'text': 'The semantic approach would allow search engines (websites that assist users in locating Web material pertaining to a subject of interest) to identify recipes that contain or do not contain certain ingredients, which would be a substantial improvement over the current state of the art in which only recipes that do or do not contain certain words can be isolated.', 'type': 'normal sentence'}, {'sent_id': 445, 'text': 'More precisely, if semantic tags are used, a search engine can identify recipes for lasagna that do not contain spinach, whereas a similar search based merely on word content would skip over a recipe that started with the statement " This lasagna does not contain spinach ".', 'type': 'normal sentence'}, {'sent_id': 446, 'text': 'In turn, by using an Internet-wide standard for marking documents according to semantics rather than appearance, a World Wide Semantic Web, rather than the World Wide Syntactic Web we have today, would be created.', 'type': 'normal sentence'}, {'sent_id': 447, 'text': 'Client-Side and Server-Side Activities', 'type': 'subsection title'}, {'sent_id': 448, 'text': "Consider now the steps that would be required for a browser to retrieve the simple webpage shown in Figure 4.10 and display it on the browser's computer screen.", 'type': 'normal sentence'}, {'sent_id': 449, 'text': 'First, playing the role of a client, the browser would use the information in a uniform resource locator (perhaps obtained from the person using the browser) to contact the webserver controlling access to the page and ask that a copy of the page be transferred to it.', 'type': 'normal sentence'}, {'sent_id': 450, 'text': 'The server would respond by sending the text document displayed in Figure 4.10a to the browser.', 'type': 'normal sentence'}, {'sent_id': 451, 'text': 'The browser would then interpret the hypertext markup language tags in the document to determine how the page should be displayed and present the document on its computer screen accordingly.', 'type': 'normal sentence'}, {'sent_id': 452, 'text': 'The user of the browser would see an image like that depicted in Figure 4.10b.', 'type': 'normal sentence'}, {'sent_id': 453, 'text': 'If the user then clicked the mouse over the word here, the browser would use the uniform resource locator in the associated anchor tag to contact the appropriate server to obtain and display another webpage.', 'type': 'normal sentence'}, {'sent_id': 454, 'text': 'In summary, the process consists of the browser merely fetching and displaying webpages as directed by the user.', 'type': 'normal sentence'}, {'sent_id': 455, 'text': 'But what if we wanted a webpage involving animation or one that allows a customer to fill out an order form and submit the order?', 'type': 'normal sentence'}, {'sent_id': 456, 'text': 'These needs would require additional activity by either the browser or the webserver.', 'type': 'normal sentence'}, {'sent_id': 457, 'text': 'Such activities are called client-side activities if they are performed by a client (such as a browser) or server-side activities if they are performed by a server (such as a webserver).', 'type': 'normal sentence'}, {'sent_id': 458, 'text': "As an example, suppose a travel agent wanted customers to be able to identify desired destinations and dates of travel, at which time the agent would present the customer with a customized webpage containing only the information pertinent to that customer's needs.", 'type': 'normal sentence'}, {'sent_id': 459, 'text': "In this case the travel agent's website would first provide a webpage that presents a customer with the available destinations.", 'type': 'normal sentence'}, {'sent_id': 460, 'text': 'On the basis of this information, the customer would specify the destinations of interest and desired dates of travel (a client-side activity).', 'type': 'normal sentence'}, {'sent_id': 461, 'text': "This information would then be transferred back to the agent's server where it would be used to construct the appropriate customized webpage (a server-side activity), which would then be sent to the customer's browser.", 'type': 'normal sentence'}, {'sent_id': 462, 'text': 'Another example occurs when using the services of a search engine.', 'type': 'normal sentence'}, {'sent_id': 463, 'text': 'In this case a user at the client specifies a topic of interest (a client-side activity), which is then transferred to the search engine where a customized webpage identifying documents of possible interest is constructed (a server-side activity) and sent back to the client.', 'type': 'normal sentence'}, {'sent_id': 464, 'text': 'Still another example occurs in the case of Web mail-an increasingly popular means by which computer users are able to access their email by means of Web browsers.', 'type': 'normal sentence'}, {'sent_id': 465, 'text': "In this case, the webserver is an intermediary between the client and the client's mail server.", 'type': 'normal sentence'}, {'sent_id': 466, 'text': "Essentially, the webserver builds webpages that contain information from the mail server (a server-side activity) and sends those pages to the client where the client's browser displays them (a client-side activity).", 'type': 'normal sentence'}, {'sent_id': 467, 'text': 'Conversely, the browser allows the user to create messages (a client-side activity) and sends that information to the webserver, which then forwards the messages to the mail server (a server-side activity) for mailing.', 'type': 'normal sentence'}, {'sent_id': 468, 'text': 'There are numerous systems for performing client - and server-side activities, each competing with the others for prominence.', 'type': 'normal sentence'}, {'sent_id': 469, 'text': 'An early and still popular means of controlling client-side activities is to include programs written in the language JavaScript (developed by Netscape Communications, Inc.) within the hypertext markup language source document for the webpage.', 'type': 'normal sentence'}, {'sent_id': 470, 'text': 'From there a browser can extract the programs and follow them as needed.', 'type': 'normal sentence'}, {'sent_id': 471, 'text': 'Another approach (developed by Sun Microsystems) is to first transfer a webpage to a browser and then transfer additional program units called applets (written in the language Java) to the browser as requested within the hypertext markup language source document.', 'type': 'normal sentence'}, {'sent_id': 472, 'text': 'Still another approach is the system Flash (developed by Macromedia) by which extensive multimedia client-side presentations can be implemented.', 'type': 'normal sentence'}, {'sent_id': 473, 'text': 'An early means of controlling server-side activities was to use a set of standards called CGI (Common Gateway Interface) by which clients could request the execution of programs stored at a server.', 'type': 'normal sentence'}, {'sent_id': 474, 'text': 'A variation of this approach (developed by Sun Microsystems) is to allow clients to cause program units called servlets to be executed at the server side.', 'type': 'normal sentence'}, {'sent_id': 475, 'text': 'A simplified version of the servlet approach is applicable when the requested server-side activity is the construction of a customized webpage, as in our travel agent example.', 'type': 'normal sentence'}, {'sent_id': 476, 'text': 'In this case webpage templates called javaserver pages (JSP) are stored at the webserver and completed using information received from a client.', 'type': 'normal sentence'}, {'sent_id': 477, 'text': 'A similar approach is used by Microsoft, where the templates from which customized webpages are constructed are called active server pages (ASP).', 'type': 'normal sentence'}, {'sent_id': 478, 'text': 'In contrast to these proprietary systems, PHP (originally standing for Personal Home Page but now considered to mean PHP Hypertext Preprocessor) is an open source system for implementing server-side functionality.', 'type': 'normal sentence'}, {'sent_id': 479, 'text': "Finally, we would be remiss if we did not recognize the security and ethical problems that arise from allowing clients and servers to execute programs on the other's machine.", 'type': 'normal sentence'}, {'sent_id': 480, 'text': 'The fact that webservers routinely transfer programs to clients where they are executed leads to ethical questions on the server side and security questions on the client side.', 'type': 'normal sentence'}, {'sent_id': 481, 'text': 'If the client blindly executes any program sent to it by a webserver, it opens itself to malicious activities by the server.', 'type': 'normal sentence'}, {'sent_id': 482, 'text': 'Likewise, the fact that clients can cause programs to be executed at the server leads to ethical questions on the client side and security questions on the server side.', 'type': 'normal sentence'}, {'sent_id': 483, 'text': 'If the server blindly executes any program sent to it by a client, security breaches and potential damage at the server could result.', 'type': 'normal sentence'}, {'sent_id': 484, 'text': '4.4 internet protocols', 'type': 'normal sentence'}, {'sent_id': 485, 'text': 'In this section we investigate how messages are transferred over the Internet.', 'type': 'normal sentence'}, {'sent_id': 486, 'text': 'This transfer process requires the cooperation of all the computers in the system, and therefore software for controlling this process resides on every computer in the Internet.', 'type': 'normal sentence'}, {'sent_id': 487, 'text': 'We begin by studying the overall structure of this software.', 'type': 'normal sentence'}, {'sent_id': 488, 'text': 'The Layered Approach to Internet Software', 'type': 'subsection title'}, {'sent_id': 489, 'text': 'A principal task of networking software is to provide the infrastructure required for transferring messages from one machine to another.', 'type': 'normal sentence'}, {'sent_id': 490, 'text': 'In the Internet, this message-passing activity is accomplished by means of a hierarchy of software units, which perform tasks analogous to those that would be performed if you were to send a gift in a package from the West Coast of the United States to a friend on the East Coast (Figure 4.12).', 'type': 'normal sentence'}, {'sent_id': 491, 'text': 'You would first wrap the gift as a package and write the appropriate address on the outside of the package.', 'type': 'normal sentence'}, {'sent_id': 492, 'text': 'Then, you would take the package to a shipping company such as the U.S. Postal Service.', 'type': 'normal sentence'}, {'sent_id': 493, 'text': 'The shipping company might place the package along with others in a large container and deliver the container to an airline, whose services it has contracted.', 'type': 'normal sentence'}, {'sent_id': 494, 'text': 'The airline would place the container in an aircraft and transfer it to the destination city, perhaps with intermediate stops along the way.', 'type': 'normal sentence'}, {'sent_id': 495, 'text': "At the final destination, the airline would remove the container from the aircraft and give it to the shipping company's office at the destination.", 'type': 'normal sentence'}, {'sent_id': 496, 'text': 'In turn, the shipping company would take your package out of the container and deliver it to the addressee.', 'type': 'normal sentence'}, {'sent_id': 497, 'text': 'In short, the transportation of the gift would be carried out by a three-level hierarchy: (1) the user level (consisting of you and your friend), (2) the shipping company, and (3) the airline.', 'type': 'normal sentence'}, {'sent_id': 498, 'text': 'Each level uses the next lower level as an abstract tool.', 'type': 'normal sentence'}, {'sent_id': 499, 'text': 'You are not concerned with the details of the shipping company, and the shipping company is not concerned with the internal operations of the airline.', 'type': 'normal sentence'}, {'sent_id': 500, 'text': 'Each level in the hierarchy has representatives at both the origin and the destination, with the representatives at the destination tending to do the reverse of their counterparts at the origin.', 'type': 'normal sentence'}, {'sent_id': 501, 'text': 'Such is the case with software for controlling communication over the Internet, except that the internet software has four layers rather than three, each consisting of a collection of software routines rather than people and businesses.', 'type': 'normal sentence'}, {'sent_id': 502, 'text': 'The four layers are known as the application layer, the transport layer, the network layer, and the link layer (Figure 4.13).', 'type': 'normal sentence'}, {'sent_id': 503, 'text': 'A message typically originates in the application layer.', 'type': 'normal sentence'}, {'sent_id': 504, 'text': 'From there it is passed down through the transport and network layers as it is prepared for transmission, and finally it is transmitted by the link layer.', 'type': 'normal sentence'}, {'sent_id': 505, 'text': "The message is received by the link layer at the destination and passed back up the hierarchy until it is delivered to the application layer at the message's destination.", 'type': 'normal sentence'}, {'sent_id': 506, 'text': 'Let us investigate this process more thoroughly by tracing a message as it finds its way through the system (Figure 4.14).', 'type': 'normal sentence'}, {'sent_id': 507, 'text': 'We begin our journey with the application layer.', 'type': 'normal sentence'}, {'sent_id': 508, 'text': 'The application layer consists of those software units such as clients and servers that use Internet communication to carry out their tasks.', 'type': 'normal sentence'}, {'sent_id': 509, 'text': 'Although the names are similar, this layer is not restricted to software in the application classification presented in Section 3.2, but also includes many utility packages.', 'type': 'normal sentence'}, {'sent_id': 510, 'text': 'For example, software for transferring files using file transfer protocol or for providing remote login capabilities using secure shell have become so common that they are normally considered utility software.', 'type': 'normal sentence'}, {'sent_id': 511, 'text': 'The application layer uses the transport layer to send and receive messages over the Internet in much the same way that you would use a shipping company to send and receive packages.', 'type': 'normal sentence'}, {'sent_id': 512, 'text': "Just as it is your responsibility to provide an address compatible with the specifications of the shipping company, it is the application layer's responsibility to provide an address that is compatible with the internet infrastructure.", 'type': 'normal sentence'}, {'sent_id': 513, 'text': 'To fulfill this need, the application layer may use the services of the name servers within the Internet to translate mnemonic addresses used by humans into Internet-compatible internet protocol addresses.', 'type': 'normal sentence'}, {'sent_id': 514, 'text': 'An important task of the transport layer is to accept messages from the application layer and to ensure that the messages are properly formatted for transmission over the Internet.', 'type': 'normal sentence'}, {'sent_id': 515, 'text': 'Toward this latter goal, the transport layer divides long messages into small segments, which are transmitted over the Internet as individual units.', 'type': 'normal sentence'}, {'sent_id': 516, 'text': 'This division is necessary because a single long message can obstruct the flow of other messages at the Internet routers where numerous messages cross paths.', 'type': 'normal sentence'}, {'sent_id': 517, 'text': 'Indeed, small segments of messages can interweave at these points, whereas a long message forces others to wait while it passes (much like cars waiting for a long train to pass at a railroad crossing).', 'type': 'normal sentence'}, {'sent_id': 518, 'text': "The transport layer adds sequence numbers to the small segments it produces so that the segments can be reassembled at the message's destination.", 'type': 'normal sentence'}, {'sent_id': 519, 'text': 'Then it hands these segments, known as packets, to the network layer.', 'type': 'normal sentence'}, {'sent_id': 520, 'text': 'From this point, the packets are treated as individual, unrelated messages until they reach the transport layer at their final destination.', 'type': 'normal sentence'}, {'sent_id': 521, 'text': 'It is quite possible for the packets related to a common message to follow different paths through the Internet.', 'type': 'normal sentence'}, {'sent_id': 522, 'text': "It is the network layer's job to decide in which direction a packet should be sent at each step along the packet's path through the Internet.", 'type': 'normal sentence'}, {'sent_id': 523, 'text': 'In fact, the combination of the network layer and the link layer below it constitutes the software residing on the Internet routers.', 'type': 'normal sentence'}, {'sent_id': 524, 'text': "The network layer is in charge of maintaining the router's forwarding table and using that table to determine the direction in which to forward packets.", 'type': 'normal sentence'}, {'sent_id': 525, 'text': 'The link layer at the router is in charge of receiving and transmitting the packets.', 'type': 'normal sentence'}, {'sent_id': 526, 'text': "Thus, when the network layer at a packet's origin receives the packet from the transport layer, it uses its forwarding table to determine where the packet should be sent to get it started on its journey.", 'type': 'normal sentence'}, {'sent_id': 527, 'text': 'Having determined the proper direction, the network layer hands the packet to the link layer for actual transmission.', 'type': 'normal sentence'}, {'sent_id': 528, 'text': 'The link layer has the responsibility of transferring the packet.', 'type': 'normal sentence'}, {'sent_id': 529, 'text': 'Thus the link layer must deal with the communication details particular to the individual network in which the computer resides.', 'type': 'normal sentence'}, {'sent_id': 530, 'text': 'For instance, if that network is an Ethernet, the link layer applies carrier sense, multiple access with collision detection.', 'type': 'normal sentence'}, {'sent_id': 531, 'text': 'If the network is a wifi network, the link layer applies carrier sense, multiple access with collision avoidance.', 'type': 'normal sentence'}, {'sent_id': 532, 'text': 'When a packet is transmitted, it is received by the link layer at the other end of the connection.', 'type': 'normal sentence'}, {'sent_id': 533, 'text': "There, the link layer hands the packet up to its network layer where the packet's final destination is compared to the network layer's forwarding table to determine the direction of the packet's next step.", 'type': 'normal sentence'}, {'sent_id': 534, 'text': 'With this decision made, the network layer returns the packet to the link layer to be forwarded along its way.', 'type': 'normal sentence'}, {'sent_id': 535, 'text': 'In this manner each packet hops from machine to machine on its way to its final destination.', 'type': 'normal sentence'}, {'sent_id': 536, 'text': 'Note that only the link and network layers are involved at the intermediate stops during this journey (see again Figure 4.14), and thus these are the only layers present on routers, as previously noted.', 'type': 'normal sentence'}, {'sent_id': 537, 'text': 'Moreover, to minimize the delay at each of these intermediate " stops ", the forwarding role of the network layer within a router is closely integrated with the link layer.', 'type': 'normal sentence'}, {'sent_id': 538, 'text': 'In turn, the time required for a modern router to forward a packet is measured in millionths of a second.', 'type': 'normal sentence'}, {'sent_id': 539, 'text': "At a packet's final destination, it is the network layer that recognizes that the packet's journey is complete.", 'type': 'normal sentence'}, {'sent_id': 540, 'text': 'In that case the network layer hands the packet to its transport layer rather than forwarding it.', 'type': 'normal sentence'}, {'sent_id': 541, 'text': "As the transport layer receives packets from the network layer, it extracts the underlying message segments and reconstructs the original message according to the sequence numbers that were provided by the transport layer at the message's origin.", 'type': 'normal sentence'}, {'sent_id': 542, 'text': 'Once the message is assembled, the transport layer hands it to the appropriate unit within the application layer-thus completing the message transmission process.', 'type': 'normal sentence'}, {'sent_id': 543, 'text': 'Determining which unit within the application layer should receive an incoming message is an important task of the transport layer.', 'type': 'normal sentence'}, {'sent_id': 544, 'text': "This is handled by assigning unique port numbers (not related to the I/O ports discussed in Chapter 2) to the various units and requiring that the appropriate port number be appended to a message's address before starting the message on its journey.", 'type': 'normal sentence'}, {'sent_id': 545, 'text': 'Then, once the message is received by the transport layer at the destination, the transport layer merely hands the message to the application layer software at the designated port number.', 'type': 'normal sentence'}, {'sent_id': 546, 'text': 'Users of the Internet rarely need to be concerned with port numbers because the common applications have universally accepted port numbers.', 'type': 'normal sentence'}, {'sent_id': 547, 'text': 'For example, if a Web browser is asked to retrieve the document whose uniform resource locator is http://www .zoo.org/animals/frog.html, the browser assumes that it should contact the hypertext transfer protocol server at www.zoo.org via port number 80.', 'type': 'normal sentence'}, {'sent_id': 548, 'text': 'Likewise, when sending email, an simple mail transfer protocol client assumes that it should communicate with the simple mail transfer protocol mail server through port number 25.', 'type': 'normal sentence'}, {'sent_id': 549, 'text': 'In summary, communication over the Internet involves the interaction of four layers of software.', 'type': 'normal sentence'}, {'sent_id': 550, 'text': "The application layer deals with messages from the application's point of view.", 'type': 'normal sentence'}, {'sent_id': 551, 'text': 'The transport layer converts these messages into segments that are compatible with the Internet and reassembles messages that are received before delivering them to the appropriate application.', 'type': 'normal sentence'}, {'sent_id': 552, 'text': 'The network layer deals with directing the segments through the Internet.', 'type': 'normal sentence'}, {'sent_id': 553, 'text': 'The link layer handles the actual transmission of segments from one machine to another.', 'type': 'normal sentence'}, {'sent_id': 554, 'text': 'With all this activity, it is somewhat amazing that the response time of the Internet is measured in milliseconds, so that many transactions appear to take place instantaneously.', 'type': 'normal sentence'}, {'sent_id': 555, 'text': 'The transmission control protocol/internet protocol Protocol Suite', 'type': 'normal sentence'}, {'sent_id': 556, 'text': 'The demand for open networks has generated a need for published standards by which manufacturers can supply equipment and software that function properly with products from other vendors.', 'type': 'normal sentence'}, {'sent_id': 557, 'text': 'One standard that has resulted is the Open System Interconnection (OSI) reference model, produced by the International Organization for Standardization.', 'type': 'normal sentence'}, {'sent_id': 558, 'text': 'This standard is based on a seven-level hierarchy as opposed to the four-level hierarchy we have just described.', 'type': 'normal sentence'}, {'sent_id': 559, 'text': 'It is an often-quoted model because it carries the authority of an international organization, but it has been slow to replace the four-level point of view, mainly because it was established after the four-level hierarchy had already become the de facto standard for the Internet.', 'type': 'normal sentence'}, {'sent_id': 560, 'text': 'The transmission control protocol/internet protocol protocol suite is a collection of protocol standards used by the Internet to implement the four-level communication hierarchy.', 'type': 'normal sentence'}, {'sent_id': 561, 'text': 'Actually, the transmission control protocol (TCP) and the internet protocol (IP) are the names of only two of the protocols in this vast collection-so the fact that the entire collection is referred to as the transmission control protocol/internet protocol protocol suite is rather misleading.', 'type': 'normal sentence'}, {'sent_id': 562, 'text': 'More precisely, transmission control protocol defines a version of the transport layer.', 'type': 'normal sentence'}, {'sent_id': 563, 'text': 'We say a version because the transmission control protocol/internet protocol protocol suite provides for more than one way of implementing the transport layer; one of the other options is defined by the user datagram protocol (UDP).', 'type': 'normal sentence'}, {'sent_id': 564, 'text': 'This diversity is analogous to the fact that when shipping a package, you have a choice of different shipping companies, each of which offers the same basic service but with its own unique characteristics.', 'type': 'normal sentence'}, {'sent_id': 565, 'text': 'Thus, depending on the particular quality of service required, a unit within the application layer might choose to send data via a transmission control protocol or user datagram protocol version of the transport layer (Figure 4.15).', 'type': 'normal sentence'}, {'sent_id': 566, 'text': 'There are several differences between transmission control protocol and user datagram protocol.', 'type': 'normal sentence'}, {'sent_id': 567, 'text': 'One is that before sending a message as requested by the application layer, a transport layer based on transmission control protocol sends its own message to the transport layer at the destination telling it that a message is about to be sent.', 'type': 'normal sentence'}, {'sent_id': 568, 'text': "It then waits for this message to be acknowledged before starting to send the application layer's message.", 'type': 'normal sentence'}, {'sent_id': 569, 'text': 'In this manner, a transmission control protocol transport layer is said to establish a connection before sending a message.', 'type': 'normal sentence'}, {'sent_id': 570, 'text': 'A transport layer based on user datagram protocol does not establish such a connection prior to sending a message.', 'type': 'normal sentence'}, {'sent_id': 571, 'text': 'It merely sends the message to the address it was given and forgets about it.', 'type': 'normal sentence'}, {'sent_id': 572, 'text': 'For all it knows, the destination computer might not even be operational.', 'type': 'normal sentence'}, {'sent_id': 573, 'text': 'For this reason, user datagram protocol is called a connectionless protocol.', 'type': 'normal sentence'}, {'sent_id': 574, 'text': 'Another difference between transmission control protocol and user datagram protocol is that transmission control protocol transport layers at the origin and destination work together by means of acknowledgments and packet retransmissions to assure that all segments of a message are successfully transferred to the destination.', 'type': 'normal sentence'}, {'sent_id': 575, 'text': 'For this reason transmission control protocol is called a reliable protocol, whereas user datagram protocol, which does not offer such retransmission services, is said to be an unreliable protocol.', 'type': 'normal sentence'}, {'sent_id': 576, 'text': "Still another distinction between transmission control protocol and user datagram protocol is that transmission control protocol provides for both flow control, meaning that a transmission control protocol transport layer at a message's origin can reduce the rate at which it transmits segments to keep from overwhelming its counterpart at the destination, as well as congestion control, meaning that a transmission control protocol transport layer at a message's origin can adjust its transmission rate to alleviate congestion between it and the message's destination.", 'type': 'normal sentence'}, {'sent_id': 577, 'text': 'All this does not mean that user datagram protocol is a poor choice.', 'type': 'normal sentence'}, {'sent_id': 578, 'text': 'After all, a transport layer based on user datagram protocol is more streamlined than a layer based on transmission control protocol, and thus if an application is prepared to handle the potential consequences of user datagram protocol, that option might be the better choice.', 'type': 'normal sentence'}, {'sent_id': 579, 'text': 'For example, the efficiency of user datagram protocol makes it the protocol of choice for domain name system lookups and voice over internet protocol.', 'type': 'normal sentence'}, {'sent_id': 580, 'text': "However, because email is less time sensitive, mail servers use transmission control protocol to transfer email. internet protocol is the Internet's standard for implementing the tasks assigned to the network layer.", 'type': 'normal sentence'}, {'sent_id': 581, 'text': "We have already observed that this task consists of forwarding, which involves relaying packets through the Internet, and routing, which involves updating the layer's forwarding table to reflect changing conditions.", 'type': 'normal sentence'}, {'sent_id': 582, 'text': 'For instance, a router may malfunction, meaning that traffic should no longer be forwarded in its direction, or a section of the Internet may become congested, meaning that traffic should be routed around the blockage.', 'type': 'normal sentence'}, {'sent_id': 583, 'text': 'Much of the internet protocol standard associated with routing deals with the protocols used for communication among neighboring network layers as they interchange routing information.', 'type': 'normal sentence'}, {'sent_id': 584, 'text': "An interesting feature associated with forwarding is that each time an internet protocol network layer at a message's origin prepares a packet, it appends a value called a hop count, or time to live, to that packet.", 'type': 'normal sentence'}, {'sent_id': 585, 'text': 'This value is a limit to the number of times the packet should be forwarded as it tries to find its way through the Internet.', 'type': 'normal sentence'}, {'sent_id': 586, 'text': "Each time an internet protocol network layer forwards a packet, it decrements that packet's hop count by one.", 'type': 'normal sentence'}, {'sent_id': 587, 'text': 'With this information, the network layer can protect the Internet from packets circling endlessly within the system.', 'type': 'normal sentence'}, {'sent_id': 588, 'text': "Although the Internet continues to grow on a daily basis, an initial hop count of 64 remains more than sufficient to allow a packet to find its way through the maze of routers within today's internet service providers.", 'type': 'normal sentence'}, {'sent_id': 589, 'text': 'For years a version of internet protocol known as IPv4 (internet protocol version four) has been used for implementing the network layer within the Internet.', 'type': 'normal sentence'}, {'sent_id': 590, 'text': 'However, the Internet is rapidly outgrowing the 32-bit internet addressing system dictated by internet protocol version four.', 'type': 'normal sentence'}, {'sent_id': 591, 'text': 'To solve this problem as well as to implement other improvements such as multicast, a new version of internet protocol known as IPv6 (internet protocol version six), which uses internet addresses consisting of 128 bits, has been established.', 'type': 'normal sentence'}, {'sent_id': 592, 'text': 'The process of converting from internet protocol version four to internet protocol version six is currently underway-this is the conversion that was alluded to in our introduction of Internet addresses in Section 4.2-and it is expected that the use of 32-bit addresses within the Internet will be extinct by 2025.', 'type': 'normal sentence'}, {'sent_id': 593, 'text': '4.5 Security', 'type': 'section title'}, {'sent_id': 594, 'text': 'When a computer is connected to a network, it becomes subject to unauthorized access and vandalism.', 'type': 'normal sentence'}, {'sent_id': 595, 'text': 'In this section we address topics associated with these problems.', 'type': 'normal sentence'}, {'sent_id': 596, 'text': 'Forms of Attack', 'type': 'subsection title'}, {'sent_id': 597, 'text': 'There are numerous ways that a computer system and its contents can be attacked via network connections.', 'type': 'normal sentence'}, {'sent_id': 598, 'text': 'Many of these incorporate the use of malicious software (collectively called malware).', 'type': 'normal sentence'}, {'sent_id': 599, 'text': 'Such software might be transferred to, and executed on, the computer itself, or it might attack the computer from a distance.', 'type': 'normal sentence'}, {'sent_id': 600, 'text': 'Examples of software that is transferred to, and executed on, the computer under attack include viruses, worms, trojan horses, and spyware, whose names reflect the primary characteristic of the software.', 'type': 'normal sentence'}, {'sent_id': 601, 'text': 'The Computer Emergency Response Team In November 1988 a worm released into the Internet caused significant disruption of service.', 'type': 'normal sentence'}, {'sent_id': 602, 'text': 'Consequently, the U.S. Defense Advanced Research Projects Agency (DARPA-pronounced " DAR-pa ") formed the Computer Emergency Response Team (CERT-pronounced " SERT "), located at the Computer Emergency Response Team Coordination Center at Carnegie - Mellon University.', 'type': 'normal sentence'}, {'sent_id': 603, 'text': 'The Computer Emergency Response Team is the Internet\'s security " watchdog ".', 'type': 'normal sentence'}, {'sent_id': 604, 'text': 'Among its duties are the investigation of security problems, the issuance of security alerts, and the implementation of public awareness campaigns to improve Internet security.', 'type': 'normal sentence'}, {'sent_id': 605, 'text': 'The Computer Emergency Response Team Coordination Center maintains a website at http://www.cert.org where it posts notices of its activities.', 'type': 'normal sentence'}, {'sent_id': 606, 'text': 'A virus is software that infects a computer by inserting itself into programs that already reside in the machine.', 'type': 'normal sentence'}, {'sent_id': 607, 'text': 'Then, when the " host " program is executed, the virus is also executed.', 'type': 'normal sentence'}, {'sent_id': 608, 'text': 'When executed, many viruses do little more than try to transfer themselves to other programs within the computer.', 'type': 'normal sentence'}, {'sent_id': 609, 'text': 'Some viruses, however, perform devastating actions such as degrading portions of the operating system, erasing large blocks of mass storage, or otherwise corrupting data and other programs.', 'type': 'normal sentence'}, {'sent_id': 610, 'text': 'A worm is an autonomous program that transfers itself through a network, taking up residence in computers and forwarding copies of itself to other computers.', 'type': 'normal sentence'}, {'sent_id': 611, 'text': 'As in the case of a virus, a worm can be designed merely to replicate itself or to perform more extreme vandalism.', 'type': 'normal sentence'}, {'sent_id': 612, 'text': "A characteristic consequence of a worm is an explosion of the worm's replicated copies that degrades the performance of legitimate applications and can ultimately overload an entire network or internet.", 'type': 'normal sentence'}, {'sent_id': 613, 'text': 'A trojan horse is a program that enters a computer system disguised as a desirable program, such as a game or useful utility package, that is willingly imported by the victim.', 'type': 'normal sentence'}, {'sent_id': 614, 'text': 'Once in the computer, however, the trojan horse performs additional activities that might have harmful effects.', 'type': 'normal sentence'}, {'sent_id': 615, 'text': 'Sometimes these additional activities start immediately.', 'type': 'normal sentence'}, {'sent_id': 616, 'text': 'In other instances, the trojan horse might lie dormant until triggered by a specific event such as the occurrence of a preselected date.', 'type': 'normal sentence'}, {'sent_id': 617, 'text': 'trojan horses often arrive in the form of attachments to enticing email messages.', 'type': 'normal sentence'}, {'sent_id': 618, 'text': 'When the attachment is opened (that is, when the recipient asks to view the attachment), the misdeeds of the trojan horse are activated.', 'type': 'normal sentence'}, {'sent_id': 619, 'text': 'Thus, email attachments from unknown sources should never be opened.', 'type': 'normal sentence'}, {'sent_id': 620, 'text': 'Another form of malicious software is spyware (sometimes called sniffing software), which is software that collects information about activities at the computer on which it resides and reports that information back to the instigator of the attack.', 'type': 'normal sentence'}, {'sent_id': 621, 'text': 'Some companies use spyware as a means of building customer profiles, and in this context, it has questionable ethical merit.', 'type': 'normal sentence'}, {'sent_id': 622, 'text': "In other cases, spyware is used for blatantly malicious purposes such as recording the symbol sequences typed at the computer's keyboard in search of passwords or credit card numbers.", 'type': 'normal sentence'}, {'sent_id': 623, 'text': 'As opposed to obtaining information secretly by sniffing via spyware, phishing is a technique of obtaining information explicitly by simply asking for it.', 'type': 'normal sentence'}, {'sent_id': 624, 'text': 'The term phishing is a play on the word fishing because the process involved is to cast numerous " lines " in hopes that someone will " take the bait ".', 'type': 'normal sentence'}, {'sent_id': 625, 'text': 'Phishing is often carried out via email, and in this form, it is little more than an old telephone con.', 'type': 'normal sentence'}, {'sent_id': 626, 'text': 'The perpetrator sends email messages posing as a financial institution, a government bureau, or perhaps a law enforcement agency.', 'type': 'normal sentence'}, {'sent_id': 627, 'text': 'The email asks the potential victim for information that is supposedly needed for legitimate purposes.', 'type': 'normal sentence'}, {'sent_id': 628, 'text': 'However, the information obtained is used by the perpetrator for hostile purposes.', 'type': 'normal sentence'}, {'sent_id': 629, 'text': 'In contrast to suffering from such internal infections as viruses and spyware, a computer in a network can also be attacked by software being executed on other computers in the system.', 'type': 'normal sentence'}, {'sent_id': 630, 'text': "An example is a denial of service (DoS) attack, which is the process of overloading a computer with messages. denial of service attacks have been launched against large commercial webservers on the Internet to disrupt the company's business and in some cases have brought the company's commercial activity to a halt.", 'type': 'normal sentence'}, {'sent_id': 631, 'text': 'A denial of service attack requires the generation of a large number of messages over a brief period of time.', 'type': 'normal sentence'}, {'sent_id': 632, 'text': 'To accomplish this, an attacker usually plants software on numerous unsuspecting computers that will generate messages when a signal is given.', 'type': 'normal sentence'}, {'sent_id': 633, 'text': 'Then, when the signal is given, all of these computers (sometimes called a botnet) swamp the target with messages.', 'type': 'normal sentence'}, {'sent_id': 634, 'text': 'Inherent, then, in denial of service attacks is the availability of unsuspecting computers to use as accomplices.', 'type': 'normal sentence'}, {'sent_id': 635, 'text': 'This is why all PC users are discouraged from leaving their computers connected to the Internet when not in use.', 'type': 'normal sentence'}, {'sent_id': 636, 'text': 'It has been estimated that once a PC is connected to the Internet, at least one intruder will attempt to exploit its existence within 20 minutes.', 'type': 'normal sentence'}, {'sent_id': 637, 'text': 'In turn, an unprotected PC represents a significant threat to the integrity of the Internet.', 'type': 'normal sentence'}, {'sent_id': 638, 'text': 'Another problem associated with an abundance of unwanted messages is the proliferation of unwanted junk email, called spam.', 'type': 'normal sentence'}, {'sent_id': 639, 'text': 'However, unlike a denial of service attack, the volume of spam is rarely sufficient to overwhelm the computer system.', 'type': 'normal sentence'}, {'sent_id': 640, 'text': 'Instead, the effect of spam is to overwhelm the person receiving the spam.', 'type': 'normal sentence'}, {'sent_id': 641, 'text': 'This problem is compounded by the fact that, as we have already seen, spam is a widely adopted medium for phishing and instigating trojan horses that might spread viruses and other detrimental software.', 'type': 'normal sentence'}, {'sent_id': 642, 'text': 'Protection and Cures', 'type': 'subsection title'}, {'sent_id': 643, 'text': 'The old adage " an ounce of prevention is worth a pound of cure " is certainly true in the context of controlling vandalism over network connections.', 'type': 'normal sentence'}, {'sent_id': 644, 'text': 'A primary prevention technique is to filter traffic passing through a point in the network, usually with a program called a firewall.', 'type': 'normal sentence'}, {'sent_id': 645, 'text': "For instance, a firewall might be installed at the gateway of an organization's intranet to filter messages passing in and out of the region.", 'type': 'normal sentence'}, {'sent_id': 646, 'text': 'Such firewalls might be designed to block outgoing messages with certain destination addresses or to block incoming messages from origins that are known to be sources of trouble.', 'type': 'normal sentence'}, {'sent_id': 647, 'text': 'This latter function is a tool for terminating a denial of service attack because it provides a means of blocking traffic from the attacking computers.', 'type': 'normal sentence'}, {'sent_id': 648, 'text': 'Another common role of a firewall at a gateway is to block all incoming messages that have origin addresses within the region accessed through the gateway because such a message would indicate that an outsider is pretending to be a member of the inside region.', 'type': 'normal sentence'}, {'sent_id': 649, 'text': "Masquerading as a party other than one's self is known as spoofing.", 'type': 'normal sentence'}, {'sent_id': 650, 'text': 'Firewalls are also used to protect individual computers rather than entire networks or domains.', 'type': 'normal sentence'}, {'sent_id': 651, 'text': 'For example, if a computer is not being used as a webserver, a name server, or an email server, then a firewall should be installed at that computer to block all incoming traffic addressed to such applications.', 'type': 'normal sentence'}, {'sent_id': 652, 'text': 'Indeed, one way an intruder might gain entry to a computer is by establishing contact through a " hole " left by a nonexistent server.', 'type': 'normal sentence'}, {'sent_id': 653, 'text': "In particular, one method for retrieving information gathered by spyware is to establish a clandestine server on the infected computer by which malicious clients can retrieve the spyware's findings.", 'type': 'normal sentence'}, {'sent_id': 654, 'text': 'A properly installed firewall could block the messages from these malicious clients.', 'type': 'normal sentence'}, {'sent_id': 655, 'text': 'Some variations of firewalls are designed for specific purposes-an example being spam filters, which are firewalls designed to block unwanted email.', 'type': 'normal sentence'}, {'sent_id': 656, 'text': 'Many spam filters use rather sophisticated techniques to distinguish between desirable email and spam.', 'type': 'normal sentence'}, {'sent_id': 657, 'text': 'Some learn to make this distinction via a training process in which the user identifies items of spam until the filter acquires enough examples to make decisions on its own.', 'type': 'normal sentence'}, {'sent_id': 658, 'text': 'These filters are examples of how a variety of subject areas (probability theory, artificial intelligence, etc.) can jointly contribute to developments in other fields.', 'type': 'normal sentence'}, {'sent_id': 659, 'text': 'Another preventative tool that has filtering connotations is the proxy server.', 'type': 'normal sentence'}, {'sent_id': 660, 'text': 'A proxy server is a software unit that acts as an intermediary between a client and a server with the goal of shielding the client from adverse actions of the server.', 'type': 'normal sentence'}, {'sent_id': 661, 'text': 'Without a proxy server, a client communicates directly with a server, meaning that the server has an opportunity to learn a certain amount about the client.', 'type': 'normal sentence'}, {'sent_id': 662, 'text': "Over time, as many clients within an organization's intranet deal with a distant server, that server can collect a multitude of information about the intranet's internal structure-information that can later be used for malicious activity.", 'type': 'normal sentence'}, {'sent_id': 663, 'text': 'To counter this, an organization can establish a proxy server for a particular kind of service (file transfer protocol, hypertext transfer protocol, telnet, etc.).', 'type': 'normal sentence'}, {'sent_id': 664, 'text': 'Then, each time a client within the intranet tries to contact a server of that type, the client is actually placed in contact with the proxy server.', 'type': 'normal sentence'}, {'sent_id': 665, 'text': 'In turn, the proxy server, playing the role of a client, contacts the actual server.', 'type': 'normal sentence'}, {'sent_id': 666, 'text': 'From then on the proxy server plays the role of an intermediary between the actual client and the actual server by relaying messages back and forth.', 'type': 'normal sentence'}, {'sent_id': 667, 'text': "The first advantage of this arrangement is that the actual server has no way of knowing that the proxy server is not the true client, and in fact, it is never aware of the actual client's existence.", 'type': 'normal sentence'}, {'sent_id': 668, 'text': "In turn, the actual server has no way of learning about the intranet's internal features.", 'type': 'normal sentence'}, {'sent_id': 669, 'text': 'The second advantage is that the proxy server is in position to filter all the messages sent from the server to the client.', 'type': 'normal sentence'}, {'sent_id': 670, 'text': 'For example, an file transfer protocol proxy server could check all incoming files for the presence of known viruses and block all infected files.', 'type': 'normal sentence'}, {'sent_id': 671, 'text': 'Still another tool for preventing problems in a network environment is auditing software that is similar to the auditing software we learned about in our discussion on operating system security (Section 3.5).', 'type': 'normal sentence'}, {'sent_id': 672, 'text': "Using network auditing software, a system administrator can detect a sudden increase in message traffic at various locations within the administrator's realm, monitor the activities of the system's firewalls, and analyze the pattern of requests being made by the individual computers in order to detect irregularities.", 'type': 'normal sentence'}, {'sent_id': 673, 'text': "In effect, auditing software is an administrator's primary tool for identifying problems before they grow out of control.", 'type': 'normal sentence'}, {'sent_id': 674, 'text': 'Another means of defense against invasions via network connections is software called antivirus software, which is used to detect and remove the presence of known viruses and other infections.', 'type': 'normal sentence'}, {'sent_id': 675, 'text': 'Actually, antivirus software represents a broad class of software products, each designed to detect and remove a specific type of infection.', 'type': 'normal sentence'}, {'sent_id': 676, 'text': 'For example, whereas many products specialize in virus control, others specialize in spyware protection.', 'type': 'normal sentence'}, {'sent_id': 677, 'text': 'It is important for users of these packages to understand that, just as in the case of biological systems, new computer infections are constantly coming on the scene that require updated vaccines.', 'type': 'normal sentence'}, {'sent_id': 678, 'text': "Thus, antivirus software must be routinely maintained by downloading updates from the software's vendor.", 'type': 'normal sentence'}, {'sent_id': 679, 'text': 'Even this, however, does not guarantee the safety of a computer.', 'type': 'normal sentence'}, {'sent_id': 680, 'text': 'After all, a new virus must first infect some computers before it is discovered and a vaccine is produced.', 'type': 'normal sentence'}, {'sent_id': 681, 'text': 'Thus, a wise computer user never opens email attachments from unfamiliar sources, does not download software without first confirming its reliability, does not respond to pop-up adds, and does not leave a PC connected to the Internet when such connection is not necessary.', 'type': 'normal sentence'}, {'sent_id': 682, 'text': 'Encryption', 'type': 'subsection title'}, {'sent_id': 683, 'text': 'In some cases the purpose of network vandalism is to disrupt the system (as in denial of service attacks), but in other cases the ultimate goal is to gain access to information.', 'type': 'normal sentence'}, {'sent_id': 684, 'text': 'The traditional means of protecting information is to control its access through the use of passwords.', 'type': 'normal sentence'}, {'sent_id': 685, 'text': 'However, passwords can be compromised and are of little value when data are transferred over networks and internets where messages are relayed by unknown entities.', 'type': 'normal sentence'}, {'sent_id': 686, 'text': 'In these cases encryption can be used so that even if the data fall into unscrupulous hands, the encoded information will remain confidential.', 'type': 'normal sentence'}, {'sent_id': 687, 'text': 'Today, many traditional Internet applications have been altered to incorporate encryption techniques, producing what are called " secure versions " of the applications.', 'type': 'normal sentence'}, {'sent_id': 688, 'text': 'A prime example is the secure version of hypertext transfer protocol, known as HTTPS (hypertext transfer protocol over secure socket layer), which is used by most financial institutions to provide customers with secure internet access to their accounts.', 'type': 'normal sentence'}, {'sent_id': 689, 'text': 'The backbone of hypertext transfer protocol over secure socket layer is the protocol system known as secure sockets layer (SSL), which was originally developed by Netscape to provide secure communication links between Web clients and servers.', 'type': 'normal sentence'}, {'sent_id': 690, 'text': 'Most browsers indicate the use of secure sockets layer by displaying a tiny padlock icon on the computer screen.', 'type': 'normal sentence'}, {'sent_id': 691, 'text': 'Some use the presence or absence of the icon to indicate whether secure sockets layer is being used; others display the padlock in either the locked or unlocked position.', 'type': 'normal sentence'}, {'sent_id': 692, 'text': 'One of the more fascinating topics in the field of encryption is public-key encryption, which involves techniques by which encryption systems are designed so that having knowledge about how messages are encrypted does not allow one to decrypt messages.', 'type': 'normal sentence'}, {'sent_id': 693, 'text': 'This characteristic is somewhat counterintuitive.', 'type': 'normal sentence'}, {'sent_id': 694, 'text': 'After all, intuition would suggest that if a person knows how messages are encrypted, then that person should be able to reverse the encryption process and thus decrypt messages.', 'type': 'normal sentence'}, {'sent_id': 695, 'text': 'But public-key encryption systems defy this intuitive logic.', 'type': 'normal sentence'}, {'sent_id': 696, 'text': 'A public-key encryption system involves the use of two values called keys.', 'type': 'normal sentence'}, {'sent_id': 697, 'text': 'One key, known as the public-key, is used to encrypt messages; the other key, known as the private-key, is required to decrypt messages.', 'type': 'normal sentence'}, {'sent_id': 698, 'text': 'To use the system, the public-key is first distributed to those who might need to send messages to a particular destination.', 'type': 'normal sentence'}, {'sent_id': 699, 'text': 'The private-key is held in confidence at this destination.', 'type': 'normal sentence'}, {'sent_id': 700, 'text': 'Then, the originator of a message can encrypt the message using the public-key and send the message to its destination with assurance that its contents are safe, even if it is handled by intermediaries who also know the public-key.', 'type': 'normal sentence'}, {'sent_id': 701, 'text': "Indeed, the only party that can decrypt the message is the party at the message's destination who holds the private-key.", 'type': 'normal sentence'}, {'sent_id': 702, 'text': "Thus if Bob creates a public-key encryption system and gives both Alice and Carol the public-key, then both Alice and Carol can encrypt messages to Bob, but they cannot spy on the other's communication.", 'type': 'normal sentence'}, {'sent_id': 703, 'text': 'Indeed, if Carol intercepts a message from Alice, she cannot decrypt it even though she knows how Alice encrypted it (Figure 4.16).', 'type': 'normal sentence'}, {'sent_id': 704, 'text': 'There are, of course, subtle problems lurking within public-key systems.', 'type': 'normal sentence'}, {'sent_id': 705, 'text': 'One is to ensure that the public-key being used is, in fact, the proper key for the destination party.', 'type': 'normal sentence'}, {'sent_id': 706, 'text': 'For example, if you are communicating with your bank, you want to be sure that the public-key you are using for encryption is the one for the bank and not an impostor.', 'type': 'normal sentence'}, {'sent_id': 707, 'text': 'If an impostor presents itself as the bank (an example of spoofing) and gives you its public-key, the messages you encrypt and send to the " bank " would be meaningful to the impostor and not your bank.', 'type': 'normal sentence'}, {'sent_id': 708, 'text': 'Thus, the task of associating public-keys with correct parties is significant.', 'type': 'normal sentence'}, {'sent_id': 709, 'text': 'One approach to resolving this problem is to establish trusted Internet sites, called certificate authorities, whose task is to maintain accurate lists of parties and their public-keys.', 'type': 'normal sentence'}, {'sent_id': 710, 'text': 'These authorities, acting as servers, then provide reliable public-key information to their clients in packages known as certificates.', 'type': 'normal sentence'}, {'sent_id': 711, 'text': "A certificate is a package containing a party's name and that party's public-key.", 'type': 'normal sentence'}, {'sent_id': 712, 'text': "Many commercial certificate authorities are now available on the Internet, although it is also common for organizations to maintain their own certificate authorities in order to maintain tighter control over the security of the organization's communication.", 'type': 'normal sentence'}, {'sent_id': 713, 'text': 'Finally, we should comment on the role public-key encryption systems play in solving problems of authentication-making sure that the author of a message is, in fact, the party it claims to be.', 'type': 'normal sentence'}, {'sent_id': 714, 'text': 'The critical point here is that, in some public-key encryption systems, the roles of the encryption and decryption keys can be reversed.', 'type': 'normal sentence'}, {'sent_id': 715, 'text': 'That is, text can be encrypted with the private-key, and because only one party has access to that key, any text that is so encrypted must have originated from that party.', 'type': 'normal sentence'}, {'sent_id': 716, 'text': 'In this manner, the holder of the private-key can produce a bit pattern, called a digital signature, that only that party knows how to produce.', 'type': 'normal sentence'}, {'sent_id': 717, 'text': 'By attaching that signature to a message, the sender can mark the message as being authentic.', 'type': 'normal sentence'}, {'sent_id': 718, 'text': 'A digital signature can be as simple as the encrypted version of the message itself.', 'type': 'normal sentence'}, {'sent_id': 719, 'text': 'All the sender must do is encrypt the message being transmitted using his or her private-key (the key typically used for decrypting).', 'type': 'normal sentence'}, {'sent_id': 720, 'text': "When the message is received, the receiver uses the sender's public-key to decrypt the signature.", 'type': 'normal sentence'}, {'sent_id': 721, 'text': 'The message that is revealed is guaranteed to be authentic because only the holder of the private-key could have produced the encrypted version.', 'type': 'normal sentence'}, {'sent_id': 722, 'text': 'We will return to the topic of public-key encryption at the end of Chapter 12, as an example of a complex computer algorithm.', 'type': 'normal sentence'}, {'sent_id': 723, 'text': 'Legal Approaches to Network Security', 'type': 'subsection title'}, {'sent_id': 724, 'text': 'Another way of enhancing the security of computer networking systems is to apply legal remedies.', 'type': 'normal sentence'}, {'sent_id': 725, 'text': 'There are, however, two obstacles to this approach.', 'type': 'normal sentence'}, {'sent_id': 726, 'text': 'The first is that making an action illegal does not preclude the action.', 'type': 'normal sentence'}, {'sent_id': 727, 'text': 'All it does is provide a legal recourse.', 'type': 'normal sentence'}, {'sent_id': 728, 'text': 'The second is that the international nature of networking means that obtaining recourse is often very difficult.', 'type': 'normal sentence'}, {'sent_id': 729, 'text': 'What is illegal in one country might be legal in another.', 'type': 'normal sentence'}, {'sent_id': 730, 'text': 'Ultimately, enhancing network security by legal means is an international project, and thus must be handled by international legal bodies-a potential player would be the International Court of Justice in The Hague.', 'type': 'normal sentence'}, {'sent_id': 731, 'text': 'Having made these disclaimers, we must admit that, although less than perfect, legal forces still have a tremendous influence, and thus it behooves us to explore some of the legal steps that are being taken to resolve conflicts in the networking arena.', 'type': 'normal sentence'}, {'sent_id': 732, 'text': 'For this purpose, we use examples from the federal laws of the United States.', 'type': 'normal sentence'}, {'sent_id': 733, 'text': 'Similar examples could be drawn from other government bodies such as the European Union.', 'type': 'normal sentence'}, {'sent_id': 734, 'text': 'We begin with the proliferation of malware.', 'type': 'normal sentence'}, {'sent_id': 735, 'text': 'In the United States this problem is addressed by the Computer Fraud and Abuse Act, which was first passed in 1984, although it has been amended several times.', 'type': 'normal sentence'}, {'sent_id': 736, 'text': 'It is under this act that most cases involving the introduction of worms and viruses have been prosecuted.', 'type': 'normal sentence'}, {'sent_id': 737, 'text': 'In short, the act requires proof that the defendant knowingly caused the transmission of a program or data that intentionally caused damage.', 'type': 'normal sentence'}, {'sent_id': 738, 'text': 'The Computer Fraud and Abuse Act also covers cases involving the theft of information.', 'type': 'normal sentence'}, {'sent_id': 739, 'text': 'In particular, the act outlaws obtaining anything of value via the unauthorized access of a computer.', 'type': 'normal sentence'}, {'sent_id': 740, 'text': 'Courts have tended to assign a broad interpretation to the phrase " anything of value ", and thus the Computer Fraud and Abuse Act has been applied to more than the theft of information.', 'type': 'normal sentence'}, {'sent_id': 741, 'text': 'For instance, courts have ruled that the mere use of a computer might constitute " anything of value ".', 'type': 'normal sentence'}, {'sent_id': 742, 'text': 'The right of privacy is another, and perhaps the most controversial, networking issue facing the legal community.', 'type': 'normal sentence'}, {'sent_id': 743, 'text': "Questions involving an employer's right to monitor the communications of employees and the extent to which an internet service provider is authorized to access the information being communicated by its clients have been given considerable thought.", 'type': 'normal sentence'}, {'sent_id': 744, 'text': 'In the United States, many of these questions are addressed by the electronic communication privacy act (ECPA) of 1986, which has its origins in legislation to control wiretapping.', 'type': 'normal sentence'}, {'sent_id': 745, 'text': 'Although the act is lengthy, its intent is captured in a few short excerpts.', 'type': 'normal sentence'}, {'sent_id': 746, 'text': 'In particular, it states that Except as otherwise specifically provided in this chapter any person who intentionally intercepts, endeavors to intercept, or procures any other person to intercept or endeavor to intercept, any wire, oral, or electronic communication.', 'type': 'normal sentence'}, {'sent_id': 747, 'text': '.', 'type': 'normal sentence'}, {'sent_id': 748, 'text': '. shall be punished as provided in subsection (4) or shall be subject to suit as provided in subsection (5). and.', 'type': 'normal sentence'}, {'sent_id': 749, 'text': '.', 'type': 'normal sentence'}, {'sent_id': 750, 'text': '. any person or entity providing an electronic communication service to the public shall not intentionally divulge the contents of any communication.', 'type': 'normal sentence'}, {'sent_id': 751, 'text': '.', 'type': 'normal sentence'}, {'sent_id': 752, 'text': '. on that service to any person or entity other than an addressee or intended recipient of such communication or an agent of such addressee or intended recipient.', 'type': 'normal sentence'}, {'sent_id': 753, 'text': "In brief, the electronic communication privacy act confirms an individual's right to private communication-it is illegal for an internet service provider to release information about the communication of its clients, and it is illegal for unauthorized personnel to eavesdrop on another's communication.", 'type': 'normal sentence'}, {'sent_id': 754, 'text': 'But the electronic communication privacy act leaves room for debate.', 'type': 'normal sentence'}, {'sent_id': 755, 'text': "For example, the question regarding the rights of an employer to monitor the communication of employees becomes a question of authorization, which courts have tended to grant to employers when the communication is carried out using the employer's equipment.", 'type': 'normal sentence'}, {'sent_id': 756, 'text': 'Moreover, the act goes on to give some government agencies authority to monitor electronic communications under certain restrictions.', 'type': 'normal sentence'}, {'sent_id': 757, 'text': 'These provisions have been the source of much debate.', 'type': 'normal sentence'}, {'sent_id': 758, 'text': 'For example, in 2000 the FBI revealed the existence of its system, called Carnivore, that reports on the communication of all subscribers of an internet service provider rather than just a court-designated target, and in 2001 in response to the terrorist attack on the World Trade Center, congress passed the controversial USA PATRIOT (Uniting and Strengthening America by Providing Appropriate Tools Required to Intercept and Obstruct Terrorism) Act that modified the restrictions under which government agencies must operate.', 'type': 'normal sentence'}, {'sent_id': 759, 'text': 'In 2013, it was subsequently revealed that these laws had been interpreted to authorize the collection of vast amounts of telephone and Internet usage data on ordinary Americans indiscriminately.', 'type': 'normal sentence'}, {'sent_id': 760, 'text': 'In addition to the legal and ethical controversies raised by these developments, providing monitoring rights raises some technical problems that are more pertinent to our study.', 'type': 'normal sentence'}, {'sent_id': 761, 'text': 'One is that to provide these capabilities, a communication system must be constructed and programmed so that communications can be monitored.', 'type': 'normal sentence'}, {'sent_id': 762, 'text': 'To establish such capabilities was the goal of the communications assistance for law enforcement act (CALEA).', 'type': 'normal sentence'}, {'sent_id': 763, 'text': 'It requires telecommunication carriers to modify their equipment to accommodate law enforcement taps-a requirement that has been complex and expensive to meet.', 'type': 'normal sentence'}, {'sent_id': 764, 'text': "Another controversial issue involves the clash between the government's right to monitor communications and the public's right to use encryption.", 'type': 'normal sentence'}, {'sent_id': 765, 'text': 'If the messages being monitored are well encrypted, then tapping the communication is of limited value to law enforcement agencies.', 'type': 'normal sentence'}, {'sent_id': 766, 'text': 'Governments in the United States, Canada, and Europe are considering systems that would require the registration of ciphering keys, but such demands are being fought by corporations.', 'type': 'normal sentence'}, {'sent_id': 767, 'text': 'After all, due to corporate espionage it is understandable that requiring the registration of ciphering keys would make many law-abiding corporations, as well as citizens, uncomfortable.', 'type': 'normal sentence'}, {'sent_id': 768, 'text': 'How secure can the registration system be?', 'type': 'normal sentence'}, {'sent_id': 769, 'text': 'Finally, as a means of recognizing the scope of legal issues surrounding the Internet, we cite the Anticybersquatting Consumer Protection Act of 1999 that is designed to protect organizations from impostors who might otherwise establish look-alike domain names (a practice known as cybersquatting).', 'type': 'normal sentence'}, {'sent_id': 770, 'text': 'The act prohibits the use of domain names that are identical or confusingly similar to another\'s trademark or " common law trademark ".', 'type': 'normal sentence'}, {'sent_id': 771, 'text': 'One effect is that although the act does not outlaw domain name speculation (the process of registering potentially desirable domain names and later selling the rights to that name), it limits the practice to generic domain names.', 'type': 'normal sentence'}, {'sent_id': 772, 'text': 'Thus, a domain name speculator might legally register a generic name such as GreatUsedCars.com but might not be able to claim rights to the name BigAlUsedCars.com if Big Al is already in the used car business.', 'type': 'normal sentence'}, {'sent_id': 773, 'text': 'Such distinctions are often the subject of debate in lawsuits based on the Anticybersquatting Consumer Protection Act.', 'type': 'normal sentence'}];

